  (34, 'Mr. Transistor', '', 'Perpetual Groove', 'Perpetual Groove', 'MR. TRANSISTOR<br><br>INTRO<br>e-----------------------&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; e-----------------------------------------<br>b--10----9----7----5----&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b--7------8-------10-8-7--8-7----------<br>g--9-----9----7----6----&nbsp;&nbsp;X4&nbsp;&nbsp; g----7------7--------------------9-7-9--<br>d--11----9----7----7----&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d------7------7---------------------------<br>a-----------------------&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a------------------------------------------<br><br>e-----------------------&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; e------------------------------------------<br><br>After you do that a few times it slows down to a bassline:<br><br>e---------------------------------------<br>b----------------------------------------<br>g---------------------------------------<br>d----------------------------------------<br>a-----------------------------------------<br>e--0-4-0-4-0-4-0-4--0-5-0-5--0-7-0-5--<br><br>Or you could play:<br><br>e----------------------------------------------<br>b----------------------------------------------<br>g----------------------------------------------<br>d----6----6----6----6----7----7----9----7---<br>a--7----7----7----7----7----7----7----7----<br>e----------------------------------------------<br><br>Band slowly builds up to the rock out part that goes like this:<br><br>G#-G#-G#-F#->E-E-E-B<br><br>They arent played like regular power chords.<br>Play this:<br>&nbsp;&nbsp; G#&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; F#&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;E&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;B<br>e-------|--------|--------|--------<br>b-------|--------|--------|--------<br>g--13---|---11---|---9----|--------<br>d--x----|---x----|---x----|---9---<br>a--11---|---9----|---7----|---x---<br>e-------|--------|--------|---7----<br><br>After it speeds back up the guitar does this:<br><br>e--0-0-12--0-0-11--0-0-9--0-0-7----0-0-12--0-0-11---9-9h11p9--7-7------<br>b-----------------------------------------------------------------------<br>g-----------------------------------------------------------------------<br>d-----------------------------------------------------------------------<br>a-----------------------------------------------------------------------<br>e-----------------------------------------------------------------------<br>', 'TLankford', '', -1, '2007-01-01 00:00:00', '2007-02-24 00:00:00', 1, -1),
  (35, 'Occam\'s Blazer', '', 'Perpetual Groove', 'Perpetual Groove', '(/ means Slide up. \\ means Slide down) - not sure if these are the right symbols<br><br>Main Riff:<br>e------------------------------<br>b------------------------------<br>g------------------------------<br>d------------------------------<br>a-------------5h6p5---------<br>e--4--6/8--6---------6-------<br><br>The rhythm behind that is Bar Chords: G# -> Bb<br><br>Then the loud part is:<br>e------------------------------<br>b------------------------------<br>g------------------------------<br>d------------------------------<br>a-------5-5------5------5--4---<br>e--4h6------4h6---4h6----------<br><br>If you want it to jam out a little louder play bar chords:<br><br>G# - D - D&nbsp;&nbsp;&nbsp;&nbsp;G# - D - D - C# ', 'TLankford', '', -1, '2007-01-01 00:00:00', '2007-02-24 00:00:00', 1, -1),
  (36, 'Perihelion', '', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', -1, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (37, 'Playground', '', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', -1, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
