  (39, 'Scooter', 'At first I tried to speculate<br>Then I asked myself why<br>I say please don’t resuscitate<br>If living feels like I died<br><br>Lying still, but still awake<br>All my thoughts head your way<br>That afternoon felt like I was crashing through<br>The mist and haze<br>The moment came to late<br><br>I made a joke, you had a laugh<br>Funny but it made me sad<br>I want to know, if it ever leaves<br>This aching pain<br>The moment came too late<br>', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (40, 'Simple Pleasures', 'The bottle is open and so is the man<br>Stumbles up to face the day<br>Like a dream the world seems to sing now<br>But it didn\'t have much to say<br><br>Said \'don\'t let stress get you head in a mess, my friend<br>close your eyes and please don\'t look at the time<br>the dishes are clean and your beds made from top to end<br>a bottle and some time and all things will be just fine\'<br><br>He\'d been wondering should he try anymore<br>He said they said is was dead<br>Should he try and go to the top now<br>Or should he just go to bed<br><br>I said, \'don\'t let stress get your head in a mess my friend<br>close your eyes and please don\'t look at the time<br>the dishes are clean and your beds made from top to end<br>a bottle and some time and all things will be just fine\'<br><br>You better get things while you can<br>You better stop them, you better grab them<br>Better ???<br>Simple Pleasures, man<br>Simple Pleasures<br>Simple Pleasures, man ', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (41, 'So Much As Goodbye', 'I fell forever<br>You said so long<br>Left me here wonderin\'<br>Just where it went wrong<br><br>You left whenever<br>No dancing, no song<br>I\'m left to wonder<br>Just where it went wrong<br><br>Now I\'m as certain<br>As the end of the sky<br>That I didn\'t deserve<br>So much as goodbye<br><br>I tried to see now<br>Through the tears in my eye<br>Why I didn\'t deserve<br>So much as goodbye ', 'Perpetual Groove', 'Perpetual Groove', '', '', '', 0, '2007-01-01 00:00:00', '2007-03-05 00:00:00', 1, -1),
  (42, 'Space Paranoids', '', 'Perpetual Groove', 'Perpetual Groove', 'opens with: D D D > Em Em (play bar chords Em @ 7th fret)<br><br>then: B > E > A > C#m (i think) - this recording is absolutely miserable<br><br>then: D > Em > A > D<br><br><br>and go back and forth between those till it gets quiet<br><br>Guitar comes in with:<br><br>e-<br>b-8p7--10p7---8p7-8p7--<br>g----7-----7<br>d-<br>a-<br>e-<br><br>keep doin that a lot. improv a little. on the 3rd 8p7, you can substitute another 10p7. brock does this<br><br>then the fun part:<br><br>e-10-10--10-10--9-9--9-9<br>b-<br>g-------7-----7----7---7<br>d-<br>a-<br>e-<br><br>do that for a while... no set amount of each note, just alternate as you like. for a more full sound (refer to 3 Weeks) Put a finger on the 10th fret of the B string. I dont think brock does it, but i could be wrong<br><br>the next riff is:<br><br>e-7-7------7----------------<br>b-----10------10------------<br>g----7----7--7--------------<br>d---------------------------<br>a---------------------------<br>e---------------------------<br><br>then:<br><br>e--------------9--10<br>b-10-10--10<br>g------7-----7--7<br>d-<br>a-<br>e-<br><br>then we go up higher:<br><br>e-10--12--14--14---10--12--14--14---14^--14--12--12--10--9--12-12--10--9--12--12---------<br>b----------------------------------------------------------------------------------------<br>g----------------------------------------------------------------------------------------<br>d----------------------------------------------------------------------------------------<br>a----------------------------------------------------------------------------------------<br>e----------------------------------------------------------------------------------------<br><br>e-14^--14--12--10----14^--14--12--10------------------------<br>b-----------------------------------------------------------<br>g-----------------------------------------------------------<br>d-----------------------------------------------------------<br>a-----------------------------------------------------------<br>e-----------------------------------------------------------<br><br>next part you have to move up and it gets a little tricky<br><br>e-----------------17------------------17-----------------14-------------------------------------<br>b-17-15-17---15-------17-15-17---15-----------15---17-----17--14--15-15---17--14--15-15---------<br>g---------------14------------------14-----14---14----14----------------------------------------<br>d-----------------------------------------------------------------------------------------------<br>a-----------------------------------------------------------------------------------------------<br>e-----------------------------------------------------------------------------------------------<br><br>e-14--15--17-17---14--15--17-17-----15--14---------15--14----------<br>b------------------------------------------17--15---------17--15---<br>g------------------------------------------------------------------<br>d------------------------------------------------------------------<br>a------------------------------------------------------------------<br>e------------------------------------------------------------------<br><br><br>and thats pretty much all the riffs... with a long ass solo like that, you just pick and choose riffs to play as you wish... improving where you see fit ', 'TLankford', '', -1, '2007-01-01 00:00:00', '2007-02-24 00:00:00', 1, -1),
  (43, 'Speed Queen', '', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', -1, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (44, 'Stealy Man', '', 'Perpetual Groove', 'Perpetual Groove', 'e----------------------------11-11-11-11-11-11-9-7-7--<br>b--4-4-4-4-4-4-2-2-0-------------------------------------<br>g-----------------------------------------------------------<br>d-----------------------------------------------------------<br>a----------------------------------------------------------<br>e-----------------------------------------------------------<br><br>Verse:<br><br>B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; F#&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; E<br>Sometimes it feels like the feeling should be grand<br><br>B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;F#&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;E<br>Strong winds from every direction<br>*Use Bar Chords*<br><br>After the Verse it does this little jam:<br>C#>B B B B B B B&nbsp;&nbsp;C#>B B B B B B B<br><br>Then back to B>F#>E<br><br>After the 2nd jam out. It does this cool part:<br><br>e-----------------------------------<br>b-----------------------------------<br>g--4-3------------1---------------<br>d-------4-1-4-------4-4-4-4-4---<br>a---------------2------------------<br>e----------------------------------<br><br>After doin that a few times the band kicks in with a loud E!!!<br><br>Then the DISTORTION kicks in for the rockin out<br><br>e-----------------------------------------------<br>b-----------------------------------------------<br>g-----------------------------------------------<br>d-----------------------------------------4-------&nbsp;&nbsp; X2<br>a--2-5-2-2--2-2-5-2-2---2-5-2-2--2-2-5-2---<br>e------------------------------------------------<br><br>Then:<br><br>e------------------<br>b-----------------<br>g-----------------<br>d-----------4--2--<br>a------2-5--------<br>e--2-5-----------<br><br><br>The rest of the song i think they just jam out in B ', 'TLankford', '', 0, '2007-01-01 00:00:00', '2007-02-24 00:00:00', 1, -1),
  (45, 'Suburban Speedball', 'shaking i\'m shaking i\'m shaking i\'m shaking i\'m shaking i\'m shaking i\'m shaking i\'m shaking i\'m shaking i\'m shaking i\'m shaking i\'m shaking<br>now i\'m fine<br>lately i feel like piece by piece i\'ve been breaking<br>i feel that i\'ve slowly been slowly been breaking<br>i feel like i feel like i\'m breaking<br>did i push too far?<br>i think that i\'d say maybe ', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (46, 'Sundog', '', 'Perpetual Groove', 'Perpetual Groove', 'Intro/Main Riff<br>e--------3--------3---------3---------3--<br>b-----3--------3---------3---------3-----<br>g--5--------4---------2---------0--------<br>d-----------------------------------------<br>a-----------------------------------------<br>e-----------------------------------------<br><br>Riff 1<br>e-------------------------------------------<br>b------------------------------5-----------&nbsp;&nbsp; Main Riff at the end of this<br>g--------4---7--5---5--4----4-----7--5--4--<br>d--5--7-------------------5----------------<br>a-------------------------------------------<br>e-------------------------------------------<br><br>Then the little chill part is just two chords<br>&nbsp;&nbsp; Cadd9&nbsp;&nbsp;&nbsp;&nbsp; G<br>e----3-------3---<br>b----3-------3---<br>g----0-------0---<br>d----2-------0---<br>a----3-------2---<br>e------------3---<br><br>Then this part here<br>e--------------------------------------------------<br>b--------------------------------------------------<br>g--5--------4--------5-------4-------------------<br>d-----5-5-----5-5-----5-5-----5-5---3-0--3-0--<br>a--------------------------------------------------<br>e--------------------------------------------------<br><br>you can play it on the G-String and just Pull off for the 5\'s on the D...whatever you want to do<br> <br>This riff comes after that. You play each 3 note progression however many times it says then move your finger to the next place<br>&nbsp;&nbsp; X6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; X6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;X12<br>e----------|---------|----------|<br>b----------|---------|----------|<br>g----------|---------|----------|<br>d---4-0-0--|--5-0-0--|--7-0-0---|<br>a----------|---------|----------|<br>e----------|---------|----------|<br><br>Transition riff/ Walk up. Also the Key for soloing<br>e--------------------------------------7----7--9--10---<br>b--------7--8----7--8--10----8--10-------------------<br>g--7--9-------------------------------------------------<br>d--------------------------------------------------------<br>a--------------------------------------------------------<br>e--------------------------------------------------------<br><br>Cool Little Jam out Part<br>e----------12------------12-----------12------------12----------------------<br>b--10^12-------10^12-------10^12-------10^12-------10^12r10--8----<br>g------------------------------------------------------------------------------<br>d------------------------------------------------------------------------------<br>a------------------------------------------------------------------------------<br>e------------------------------------------------------------------------------<br><br>So you solo around inbetween that Jam Riff<br>Then they go back to the one before - 4-0-0 5-0-0... and play this instead<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br>&nbsp;&nbsp;&nbsp;&nbsp; X6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;X6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;X12<br>e--14-------|--15--------|--17-------<br>b-----15----|-----15----|------15----<br>g--------14-|--------14-|---------14-<br>d------------|------------|-------------<br>a------------|------------|-------------<br>e------------|------------|-------------<br>', 'TLankford', '', -1, '2007-01-01 00:00:00', '2007-02-24 00:00:00', 1, -1),
  (47, 'Sweet Oblivious Antidote', 'I said let it ride then <br>Burn up so bright that no one can see <br>Maybe just hide then <br>A good place could be right in front of me <br>Cause I\'m busy searching<br>Searching for what? I\'m not really sure <br>Maybe and answer <br>Maybe some sweet oblivious cure<br>', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (48, 'Teakwood Betz', '', 'Perpetual Groove', 'Perpetual Groove', '<br>G------------------------------------------|<br>D------------------------------------------|<br>A-----9-----------12----------7------------|X2<br>E-7-7---7---10-10----10---5-5---5----------|<br>B------------------------------------------|<br><br>DRUMS IN<br><br>G------------------------------------------|<br>D------------------------------------------|<br>A-----9-----------12----------7------------|X2<br>E-7-7---7---10-10----10---5-5---5----------|<br>B------------------------------------------|<br><br>FULL DRUM IN (echo guitar)<br><br>G------------------------------------------|<br>D------------------------------------------|<br>A-----9-----------12----------7------------|X4<br>E-7-7---7---10-10----10---5-5---5----------|<br>B------------------------------------------|<br><br>Guitar in<br><br>G------------------------------------------|<br>D------------------------------------------|<br>A-----9-----------12----------7------------|X4<br>E-7-7---7---10-10----10---5-5---5----------|<br>B------------------------------------------|<br><br>Verse<br>G------------------------------------------|<br>D------------------------------------------|<br>A-----9-----------12----------7------------|X4<br>E-7-7---7---10-10----10---5-5---5----------|<br>B------------------------------------------|<br><br>PRELUDE<br>G------------------------------------------|<br>D------------------------------------------|<br>A-----9---------9---------9---------9------|X2<br>E-7-7---7---7-7---7---7-7---7---7-7---7----|<br>B------------------------------------------|<br><br>VERSE (with guitar low)<br><br>G------------------------------------------|<br>D------------------------------------------|<br>A-----9-----------12----------7------------|X4<br>E-7-7---7---10-10----10---5-5---5----------|<br>B------------------------------------------|<br><br>VERSE (with guitar high)<br><br>G------------------------------------------|<br>D------------------------------------------|<br>A-----9-----------12----------7------------|X8<br>E-7-7---7---10-10----10---5-5---5----------|<br>B------------------------------------------|<br><br>PRELUDE<br>G------------------------------------------|<br>D------------------------------------------|<br>A-----9---------9---------9---------9------|<br>E-7-7---7---7-7---7---7-7---7---7-7---7----|<br>B------------------------------------------|<br><br>VERSE 2<br><br>G-------6------------------6---------------|<br>D------------------------------------------|<br>A---7h9---9-9-7-99-----7h9---7-7-7-7-7-----|X4<br>E-7------------------7---------------------|<br>B------------------------------------------|<br><br>REPEAT<br>G------------------------------------------|<br>D-9---7-------------9---7------------------|<br>A---9---9-9-7-9-9-----9---7-7-7-7-7--------|X6 (X4 2ND TIME)<br>E------------------------------------------|<br>B------------------------------------------|<br><br>G-----6------------------------------------|<br>D-9-----------------9---7------------------|<br>A---9---9-9-7-9-9-----9---7-7-7-7-7--------|<br>E------------------------------------------|<br>B------------------------------------------|<br>Improv off this<br>G------------------------------------------|<br>D-9---7-------------9---7------------------|<br>A---9---9-9-7-9-9-----9---7-7-7-7-7--------|X??<br>E------------------------------------------|<br>B------------------------------------------|<br><br>(improv on this also)<br>G---------------------------------|<br>D-9----7--------------------------|<br>A--9X9--999-----------------------|X???<br>E---------------------------------|<br>B---------------------------------|<br><br><br>G------------------------------------------|<br>D-9---7-------------9---7------------------|<br>A---9---9-9-7-9-9-----9---7-7-7-7-7--------|<br>E------------------------------------------|<br>B------------------------------------------|<br><br>G-----6------------------------------------|<br>D-9-----------------9---7------------------|<br>A---9---9-9-7-9-9-----9---7-7-7-7-7--------|<br>E------------------------------------------| X????<br>B------------------------------------------|<br><br>ENDING<br>G------------------------------------------|<br>D------------------------------------------|<br>A-----9---------9---------9---------9------|<br>E-7-7---7---7-7---7---7-7---7---7-7---7----|<br>B------------------------------------------| ', 'Redcarpet', '', -1, '2007-01-01 00:00:00', '2007-02-24 00:00:00', 1, -1),
  (49, 'The Universe', '', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', -1, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (50, 'Thinkin\' Those Thoughts', 'It\'s time to find my mind<br>I trip and fall<br>We\'ve all been here before, once more<br>I\'m slippin thru, Leave you be-<br>Hind all the matter<br>Sit with the madhatter<br>Take tea with the mouse<br>Bust out all the windows<br><br>Chorus<br><br>My wallet and change, car keys<br>Can\'t seem to locate these<br>Thoughts that are eluding<br>My mind is confusing me<br>Intensity my sight<br>Don\'t pet the dog<br>Might bite<br>Foam at the mouth<br>Lose sight<br><br>That funking dog just might die<br><br>Chorus ', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (51, 'Three Weeks', 'It\'s been about three weeks now, since I laid in a bed <br>No rest for my soul I need, A little soul rest for my head <br>See I\'ve been dancing with possibilities, playing with my razor blade <br>I lost the thing I though I had, the thing that made me think I had it made <br>Why are you laying down? I said that it beats standing up <br>What\'s got you feeling so down, I hold up my empty cup <br>My friend, as you can see, I have nothing to pour <br>Invited in, I gave all I had and they showed me the door <br>They showed me the door <br>It seems it\'s been forever now, I\'m giving up on that bed <br>I ain\'t got much soul left now, And I don\'t have that much bread <br>Seeing that there are no more possibilities, I\'ve tossed away my razor blade <br>I never had the thing I thought I had, the thing that made me think I had it made <br>Think I had it made <br>Why are you laying down? I said that it beats standing up <br>What\'s got you feeling so down, I hold up my empty cup <br>My friend, as you can see, I have nothing to pour <br>Invited in, I gave all I had and they showed me the door <br>They showed me the door<br>', 'Perpetual Groove', 'Perpetual Groove', 'Main Lick:<br><br><br>E---|----10--9--10-----------10--9--10-----------10--9--10----------10--9-----|<br>B---|--------------10--------------------10-----------------10-------------10-|<br>G-7-|-7------------------7----------------------7----------------7------------|<br>D---|-------------------------------------------------------------------------|<br>A---|-------------------------------------------------------------------------|<br>E---|-------------------------------------------------------------------------|<br><br><br><br><br>E------------10-------------10----------------10------------10-----------------|<br>B------8-----------8---7-----------7-------------------------------------------|<br>G------------------------------------------9---------9---9---------9-----------| <br>D------------------------------------------------------------------------------|<br>A------------------------------------------------------------------------------|<br>E------------------------------------------------------------------------------|<br>repeat 2 times<br><br><br>Let that D at the 10th fret on the E string ring out while you’re playing the other notes.<br><br>Brock changes up the ending to that last lick a bunch so play around with picking between the 9 on G and 10 on E. If you’re up for the stretch then you can also play that E at the 9th fret on the G string on the 5th fret of the B string.<br><br>Verse<br><br><br>&nbsp;&nbsp;&nbsp;&nbsp;Dsus2&nbsp;&nbsp; G&nbsp;&nbsp;&nbsp;&nbsp;D/F#&nbsp;&nbsp; Em<br>E----0------3-----2----------------|<br>B----3------3-----3----------------|<br>G----2------0-----2-----0----------|<br>D----0------0-----0-----2----------|<br>A-----------2-----0-----2----------|<br>E-----------3-----2-----0----------|<br><br><br><br><br>E-------------------------------------------------------------------------|<br>B-----------3---2---3---------------------3---2---3-----------------------|<br>G---------------------------2------------------------------2--------------|<br>D------0---------------------------0--------------------------------------|<br>A-------------------------------------------------------------------------|<br>E-------------------------------------------------------------------------|<br><br><br>Why are you layin down…<br><br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;F#m&nbsp;&nbsp; G<br>E-----2-----3-------|<br>B-----2-----3-------|<br>G-----2-----0-------|<br>D-----4-----0-------|<br>A-----4-----2-------|<br>E-----2-----3-------|<br><br><br><br><br>E-------------------------------------------------------------------------|<br>B-----------3---2---3---------------------3---2---3-----------------------|<br>G---------------------------2------------------------------2--------------|<br>D------0---------------------------0--------------------------------------|<br>A-------------------------------------------------------------------------|<br>E-------------------------------------------------------------------------|<br><br><br>Brock solos for a little while in D major, then they break into the disco type section.<br><br>Disco Part<br><br><br><br>&nbsp;&nbsp;&nbsp;&nbsp; D&nbsp;&nbsp;&nbsp;&nbsp; Bm&nbsp;&nbsp;&nbsp;&nbsp; C<br>E------------------------|<br>B----7-----3------5------|<br>G----7-----4------5------|<br>D----7-----4------5------|<br>A----5-----2------3------|<br>E------------------------|<br><br><br>Anything else Brock does live is just messing around with D Bm and C in different positions. Solo in D major and B minor, which is the same scale.<br><br><br><br>E-----10---9---------------------|<br>B----------------10----7---------|<br>G--------------------------------|<br>D--------------------------------|<br>A--------------------------------|<br>E--------------------------------|<br><br><br>That’s a common lick that you can hear in the Disco part a lot. It’s played slow letting the notes ring out.<br><br>After the Disco part, they go back into the main lick, and then into the verse again. There’s another instrumental part afterward which builds and builds to the beautiful slow ending.<br><br><br><br>E------10------9--------|--9--10---7---------------------7---------------------|<br>B------10-----10----10--|---------------10---8----------------10---8-----------|<br>G------11-----11--------|--------------------------7----------------------7----|<br>D-------0------0--------|------------------------------------------------------|<br>A-----------------------|------------------------------------------------------|<br>E-----------------------|------------------------------------------------------| ', 'cchandler', '', 0, '2007-01-01 00:00:00', '2007-02-24 00:00:00', 1, -1),
  (52, 'TSMM', 'My soul rises up when the sun sets down <br>I hang up the phone when I don\'t hear a sound <br>All that I know is that I hope that you know <br>That I\'m doing fine <br>All that I know is that I hope that you know <br>Lord to keep shining<br>We lay down the tones when the sun hits the ground <br>What good is a phone if it doesn\'t make a sound <br>All that I know is that I hope that you know <br>That we\'re doing fine <br>All that I know is that I hope that you know <br>Lord to keep shining<br>', 'Perpetual Groove', 'Perpetual Groove', 'Intro:<br><br>E------------------------------------------------------------------------|<br>B------------------------------------------------------------------------|<br>G------------------------------------------------------------------------|<br>D---3--3--3--3--3--2---------------3--3--3--3--3--2----------------------|<br>A------------------------3------------------------------3----------------|<br>E-----------------------------3------------------------------3--3--------|<br><br><br>Brock scratches a bit by putting his left hand across all the strings and then strumming with his right hand. When you hear that kind of noise, that is generally what he is doing.<br><br>The progression of the song is C--G--F throughout the whole song, and below are the bar chords I’ve seen him use, but the second set of chords are just some that I find fit very nice in the mellow solo section.<br><br>C-G-F chords<br><br>E---------3----1-----------0----0-----0----|<br>B----5----3----1-----------1----3-----1----|<br>G----5----4----2-----------0----4-----2----|<br>D----5----5----3-----------2----5-----3----|     <br>A----3----5----3-----------3----5-----3----|<br>E---------3----1----------(3)--------------|<br><br><br>With the G bar chord, Brock will sometimes take his pinky finger off the 5 th fret of the D-string and put it on the 5 th fret of the B-string. And when he gets to the F bar chord, he will do the same thing except out his pinky on the 3 rd fret of the high E-string. Like so:<br><br>E-----3--------------------1--------------3-----|<br>B-----3----5----3----------1--------------1-----|<br>G-----4--------------------2----->>-------2-----|<br>D-----3--------------------1----->>-------1-----|<br>A-----5--------------------3--------------3-----|<br>E-----3--------------------1--------------1-----|<br><br><br>He doesn’t emphasize the chords without the pinky’s (the chords without the pinky’s make them a G7 and F7 chord), so try not to play the D-string too loud, but rather bring out the notes you’re playing with your pinky. If that makes sense at all!<br><br>Brock solos in C major before the first verse, so you can use your C Major and C Major Pentatonic Scales to sound awesome.<br><br>After he sings the lyrics, they do a bunch of quick hits on C-G-F for a while then fade into the mellow part. Somewhere along the line he busts out that nice lap steel guitar, and when he’s finished soloing they go back into the lyrics again.<br><br>After the lyrics again, they do a bunch of hits on G--G--F. Then after that, Adam plays the opening intro on the bass behind it all, and then Matt comes in with that beautiful piano line. Brock then hits these notes, he picks them a lot, so I’m only going to tab them out once.<br><br>E------5--8--7--5--3----|---5--8--7--5--3----|-----5--8--7--8----5---8--7-----|----5--8--7--8---5--8--7----|<br>B-----------------------|--------------------|--------------------------------|----------------------------|<br>G-----------------------|--------------------|--------------------------------|----------------------------|<br>D-----------------------|--------------------|--------------------------------|----------------------------|     <br>A-----------------------|--------------------|--------------------------------|----------------------------|<br>E-----------------------|--------------------|--------------------------------|----------------------------|<br><br>Brock then solos in C Major again, so you can use the same scales, and then they end the song with the intro. Brock does it up and octave higher though.<br><br>E----13--13--13-13--13--12-------------------------13--13--13--13--13--12-----------15---|<br>B-----------------------------13---------------------------------------------13----------|<br>G-----------------------------------12--12-----------------------------------------------|<br>D----------------------------------------------------------------------------------------|     <br>A----------------------------------------------------------------------------------------|<br>E----------------------------------------------------------------------------------------| ', 'cchandler', '', 0, '2007-01-01 00:00:00', '2007-05-30 00:00:00', 1, -1),
  (53, 'TTFPJ', 'TTFPJ! TTFPJ!<br>TTFPJ! TTFPJ!<br>TTFPJ! TTFPJ!<br>TTFPJ! TTFPJ!<br><br>You\'re so sensitive! You\'re so sensitive!<br>You\'re so sensitive! You\'re so sensitive!<br>You\'re so sensitive! You\'re so sensitive!<br>You\'re so sensitive! You\'re so sensitive!<br><br>JB Huff \'n Stuff! JB Huff \'n Stuff!<br>JB Huff \'n Stuff! JB Huff \'n Stuff!<br>JB Huff \'n Stuff! JB Huff \'n Stuff!<br>JB Huff \'n Stuff! JB Huff \'n Stuff!<br><br>_______ is the man! _______ is the man!<br>_______ is the man! _______ is the man!<br>_______ is the man! _______ is the man!<br>_______ is the man! _______ is the fucking man!<br><br>...<br><br>TTFPJ! TTFPJ!<br>TTFPJ! TTFPJ!<br>TTFPJ! TTFPJ!<br>TTFPJ! TTFPJ!', 'Perpetual Groove', 'Perpetual Groove', 'TTFPJ<br><br>Intro/Main Riff<br>e---------------------------------------------------<br>b----------------------------------------------------<br>g----------------------------------------------5--<br>d---------------5---------------7-------------------<br>a--------5-6-7-----------5-6-7----------5-6-7-----<br>e--5--8------------5--8------------5--8------------<br><br>e-----------------------------------------<br>b-----------------------------------------<br>g--5-------------------------------------<br>d-----7p6p5h7--------------------------<br>a--------------7p6p5h7--5--------5--<br>e-------------------------8-5-8-----<br><br>then.. TTFPJ TTFPJ<br><br>During the verse, you Palm Mute and play an A. But just hit the A and D strings... Not really looking for much sound till the end of each measure where you Strum the A all the way down<br><br>Example:<br><br>P.M.--------------Strum<br>T T F P J&nbsp;&nbsp; T T F P J<br><br>Alternate back and forth between that and the Main Riff<br><br>*During the fast end partof the Main Riff, the is doing the chord progression:<br><br>D - C - A - G - A<br><br><br>And thats pretty much all of TTFPJ. The funk jam session is played in A. Go for the gold and make it happen ', 'TLankford', '', 0, '2007-01-01 00:00:00', '2007-03-03 00:00:00', 1, -1),
  (54, 'Tu Sevun', 'When the dawn lifts, cause you know that it\'s gonna<br>Let that light shine out all the clearer<br>The truth to that story is they\'re already gonna<br>Face that the end could always be near<br><br>Now things are better cause I dont\' have to wonder<br>If tomorrow\'s gonna hurt or what i\'ll have to face<br>This is the blanket that I sleep soundly under<br>It helps me understand, helps me keep my face<br><br>When the dawn lifts cause you know that it\'s gonna<br>Let that light shine out all the clearer<br>The truth to that story is were\'re already gonna<br>Face that the end could always be near ', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (55, 'Walking in Place', 'Walking in place <br>We wave the smoke out of our face and then we see you <br>Hellos and goodbyes <br>The door still shuts in our eyes and we still leave you <br>And all that is hoped for is after this while girl <br>I hope that you smile when you\'re singing<br>After the smile\'s gone and after this time girl <br>Lord after this while, will you see me? <br>Turn to your friend <br>and then we\'ll ask you again if it was alright <br>around some other bend to some other end <br>on some other night <br>And all that is hoped for is after this while girl <br>I hope that you smile when you\'re singing<br>After the smile\'s gone and after this time girl <br>Lord after this while, will you see me? <br>', 'Perpetual Groove', 'Perpetual Groove', '<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; G#m&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; F#maj7<br>E------4------4-------1---------6-------|<br>B------4------7-------2---or----6-------|<br>G------4------4-------3---------6-------|<br>D------4------4-------4---------4-------|<br>A------6------6-------------------------|<br>E------4------4-------------------------|<br><br><br>Brock plays the G#m and throws his pinky on the 7th fret of the B string but I can’t really tab out the rhythm so listen to the song to get the feel of it. I’ve seen him use that first shape of the F#maj7 live, but if it’s too hard or you can’t do it, the second shape is also the same chord just a different voicing.<br><br>All that is hoped for…<br><br>&nbsp;&nbsp;&nbsp;&nbsp; <br>&nbsp;&nbsp;&nbsp;&nbsp; F#&nbsp;&nbsp;&nbsp;&nbsp; C#&nbsp;&nbsp;&nbsp;&nbsp;B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;D#m&nbsp;&nbsp;C#&nbsp;&nbsp;&nbsp;&nbsp; B<br>E-----2------------------6-----------------|<br>B-----2-----6-----4------7-----6-----4-----|<br>G-----3-----6-----4------8-----6-----4-----|<br>D-----4-----6-----4------8-----6-----4-----|<br>A-----4-----4-----2------6-----4-----2-----|<br>E-----2------------------------------------|<br><br><br>The whole time you can solo in F# major.', 'cchandler', '', 0, '2007-01-01 00:00:00', '2007-02-24 00:00:00', 1, -1),
  (56, 'Going Home', '', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', -1, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (57, 'All Night Long', 'Well, my friends, the time has come<br>To raise the roof and have some fun<br>Throw away the work to be done<br>Let the music play on<br>(play on, play on)<br>Everbody sing, everybody dance<br>Lose yourself in wild romance<br>Were going to party<br>Karamu, fiesta, forever<br>Come on and sing along!<br>Were going to party<br>Karamu, fiesta, forever<br>Come onand sing along!<br>Were going to party<br>Karamu, fiesta, forever<br>Come on and sing along!<br>All night long! (all night)<br>All night long! (all night)<br>All night long! (all night)<br>People dancing all in the street<br>See the rhythm all in their feet<br>Life is good wild and sweet<br>Let the music play on<br>(play on, play on)<br>Feel it in your heart<br>And feel it in your soul<br>Let the music take control<br>Were going to party<br>Liming, fiesta, forever<br>Come on and sing my song!<br>All night long! (all night)<br>All night long! (all night)<br>All night long! (all night)<br>All night long! (all night)<br>Yeah, once you get started<br>You cant sit down<br>Come join the fun<br>Its a merry go round<br>Everyones dancing<br>Their troubles away<br>Come join our party<br>See how we play!<br>Oh, yes<br>Were going to have a party!<br>All night long! (all night)<br>All night long! (all night)<br>All night long! (all night)<br>All night long!<br>Everyone you meet<br>Theyre jamming in the street<br>All night long1<br>Yeah, I said, everyone you meet<br>Theyre jamming in the street<br>All night long!<br>Yeah, I said, everyone you meet<br>Theyre jamming in the street<br>All night long!<br>Feel good! feel good!', 'Lionel Richie', 'Lionel Richie', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (58, 'Auld Lang Syne', 'Should auld acquaintance be forgot,<br>And never brought to mind?<br>Should auld acquaintance be forgot,<br>And auld lang syne?<br><br>For auld lang syne, my dear,<br>For auld lang syne,<br>We\'ll tak a cup of kindness yet,<br>For auld lang syne!', '(Traditional)', '', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (59, 'Boogie Nights', 'Boogie nights oh<br>Boogie nights, boogie nights<br><br>Boogie nights<br>Ain\'t no doubt we are here till morning<br>Boogie nights<br>Come on now got to get it started<br><br>Dance with the boogie get high<br>\'Cos boogie nights are always the best in town<br>Got to keep on dancing<br>Keep on dancing<br>Got to keep on dancing<br>Keep on dancing<br><br>(Party night)<br>Can you show that you know how to do it<br>(Boogie nights)<br>Do it, do it<br>Party night<br>Settle down with the sound of the music<br>(Boogie night)<br>Music, music<br><br>Boogie nights<br>Get that groove let it take you higher<br>Boogie nights<br>Make it move set this place on fire<br><br>Boogie nights<br>Feel so right when you got the feeling<br>Boogie nights<br>Hold you tight get to keep on dealing', 'Quincy Jones and Rod Temperton', 'Heatwave', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-09 00:00:00', 386, -1),
  (60, 'Bulls on Parade', 'Come wit it now!<br>Come wit it now!<br>The microphone explodes, shattering the molds<br>Either drop tha hits like de la O or get tha fuck off tha commode<br>Wit tha sure shot, sure ta make tha bodies drop<br>Drop an don\'t copy yo, don\'t call this a co-op<br>Terror rains drenchin\', quenchin\' tha thirst of tha power dons<br>That five sided fist-a-gon<br>Tha rotten sore on tha face of mother earth gets bigger<br>Tha triggers cold empty ya purse<br><br>Rally round tha family! With a pocket full of shells<br>They rally round tha family! With a pocket full of shells<br>They rally round tha family! With a pocket full of shells<br>They rally round tha family! With a pocket full of shells<br><br>Weapons not food, not homes, not shoes<br>Not need, just feed the war cannibal animal<br>I walk tha corner to tha rubble that used to be a library<br>Line up to tha mind cemetary now<br>What we don\'t know keeps tha contracts alive an movin\'<br>They don\'t gotta burn tha books they just remove \'em<br>While arms warehouses fill as quick as tha cells<br>Rally round tha family, pockets full of shells<br><br>Rally round tha family! With a pocket full of shells<br>They rally round tha family! With a pocket full of shells<br>They rally round tha family! With a pocket full of shells<br>They rally round tha family! With a pocket full of shells<br><br>Bulls on parade!', 'Zach De La Rocha', 'Rage Against The Machine', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (61, 'Can You Get To That', 'I once had a life, or rather<br>Life had me<br>I was one among many<br><br>Or at least I seemed to be<br>Well, I read an old quotation in a book just yesterday<br>Said Gonna reap just what you sow,<br>The debts you make you have to pay.<br>Can you get to that?<br><br>Can you get (I wanna know)<br>I want to know if you can get to that (hey!) (get to that!)<br>Can you get (can you get to that)(I wanna know)<br>I want to know if you can get to that<br><br>I recollect with a-mixed emotions<br>All the good times we used to have<br>But you were making preparations<br>For the coming separation<br>And you blew everything we had<br><br>When you base your love on credit<br>And your loving days are done<br>Checks you signed with a-love and kisses<br>Later come back signed insufficient funds<br>Yeah, get to that!<br><br>Can you get (I wanna know)<br>I want to know if you can get to that (hey!) (get to that!)<br>Can you get (can you get to that)(I wanna know)<br>I want to know if you can get to that<br>(x3)<br><br>When you base your life on credit<br>And your loving days are done<br>Checks you signed with love and kisses<br>Later come back signed insufficient funds<br>Y\'all get to that<br><br>Can you get (I wanna know)<br>I want to know if you can get to that (hey!) (get to that!)<br>Can you get (can you get to that)(I wanna know)<br>I want to know if you can get to that', 'George Clinton, Ernie Harris', 'Funkadelic', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (62, 'Dear Prudence', 'Dear Prudence, won\'t you come out to play<br>Dear Prudence, greet the brand new day<br>The sun is up, the sky is blue<br>It\'s beautiful and so are you<br>Dear Prudence won\'t you come out to play<br><br>Dear Prudence open up your eyes<br>Dear Prudence see the sunny skies<br>The wind is low the birds will sing<br>that you are part of everything<br>Dear Prudence won\'t you open up your eyes?<br><br>Look around round<br>Look around round round<br>Look around<br><br>Dear Prudence let me see you smile<br>Dear Prudence like a little child<br>The clouds will be a daisy chain<br>So let me see you smile again<br>Dear Prudence won\'t you let me see you smile?<br><br>Dear Prudence, won\'t you come out to play<br>Dear Prudence, greet the brand new day<br>The sun is up, the sky is blue<br>It\'s beautiful and so are you<br>Dear Prudence won\'t you come out to play', 'Lennon/McCartney', 'The Beatles', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (63, 'Diamonds On The Soles of Her Shoes', '(a-wa) O kodwa u zo-nge li-sa namhlange<br>(a-wa a-wa) Si-bona kwenze ka kanjani<br>(a-wa a-wa) Amanto mbazane ayeza<br><br>She\'s a rich girl<br>She don\'t try to hide it<br>Diamonds on the soles of her shoes<br><br>He\'s a poor boy<br>Empty as a pocket<br>Empty as a pocket with nothing to lose<br>Sing Ta na na<br>Ta na na na<br>She got diamonds on the soles of her shoes<br>Sing ta na na<br>Ta na na na<br>She got diamonds on the soles of her shoes<br>Diamonds on the soles of her shoes<br>Diamonds on the soles of her shoes<br>Diamonds on the soles of her shoes<br>Diamonds on the soles of her shoes<br><br>People say she\'s crazy<br>She got diamonds on the soles of her shoes<br>Well that\'s one way to lose these<br>Walking blues<br>Diamonds on the soles of her shoes<br><br>She was physically forgotten<br>but then she slipped into my pocket<br>With my car keys<br>She said you\'ve taken me for granted<br>Because I please you<br>Wearing these diamonds<br><br>And I could say Oo oo oo<br>As if everybody knows<br>What I\'m talking about<br>As if everybody here would know<br>Exactly what I was talking about<br>Talking about diamonds on the soles of her shoes<br><br>She makes the sign of a teaspoon<br>He makes the sign of a wave<br>The poor boy changes clothes<br>And puts on after-shave<br>To compensate for his ordinary shoes<br><br>And she said honey take me dancing<br>But they ended up by sleeping<br>In a doorway<br>By the bodegas and the lights on<br>Upper Broadway<br>Wearing diamonds on the soles of their shoes<br><br>And I could say Oo oo oo<br>As if everybody here would know<br>What I was talking about<br>I mean everybody here would know exactly<br>What I was talking about<br>Talking about diamonds<br><br>People say I\'m crazy<br>I got diamonds on the soles of my shoes yeah<br>Well that\'s one way to lose<br>These walking blues<br>diamonds on the soles of my shoes<br><br>ta na na na<br>ta na na na na<br>ta na na na<br>ta na na na na', 'Paul Simon', 'Paul Simon', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (64, 'Diggin\' In The Dirt', 'Something in me, dark and sticky<br>All the time it\'s getting strong<br>No way of dealing with this feeling<br>Can\'t go on like this too long<br><br>This time you\'ve gone too far<br>This time you\'ve gone too far<br>This time you\'ve gone too far,<br>I told you, I told you, I told you, I told you<br><br>Don\'t talk back, just drive the car<br>Shut your mouth, I know what you are<br>Don\'t say nothing, keep your hands on the wheel<br>Don\'t turn around, this is for real<br><br>Digging in the dirt<br>Stay with me I need support<br>I\'m digging in the dirt<br>Find the places I got hurt<br>Open up the places I got hurt<br><br>The more I look, the more I find<br>As I close on in, I get so blind<br>I feel it in my head, I feel it in my toes<br>I feel it in my sex, that\'s the place it goes<br><br>This time you\'ve gone too far<br>This time you\'ve gone too far<br>This time you\'ve gone too far,<br>I told you, I told you, I told you, I told you<br><br>Don\'t talk back, just drive the car<br>Shut your mouth, I know what you are<br>Don\'t say nothing, keep your hands on the wheel<br>Don\'t turn around, this is for real<br><br>Digging in the dirt, to find the places we got hurt...', 'Peter Gabriel', 'Peter Gabriel', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (65, 'Do It Again', 'In the mornin you go gunnin\'<br>For the man who stole your water<br>And you fire till he is done in<br>But they catch you at the border<br>And the mourners are all singin\'<br>As they drag you by your feet<br>But the hangman isn\'t hangin\'<br>And they put you on the street<br><br>CHORUS:<br>You go back Jack do it again<br>Wheel turnin\' \'round and \'round<br>You go back Jack do it again<br><br>When you know she\'s no high climber<br>Then you find your only friend<br>In a room with your two timer<br>And you\'re sure you\'re near the end<br>Then you love a little wild one<br>And she brings you only sorrow<br>All the time you know she\'s smilin\'<br>You\'ll be on your knees tomorrow<br><br>CHORUS<br><br>Now you swear and kick and beg us<br>That you\'re not a gamblin\' man<br>Then you find you\'re back in Vegas<br>With a handle in your hand<br>Your black cards can make you money<br>So you hide them when you\'re able<br>In the land of milk and honey<br>You must put them on the table<br><br>CHORUS', 'Walter Becker and Donald Fagen', 'Steely Dan', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (66, 'Escape', 'I was tired of my lady, we\'d been together too long.<br>Like a worn-out recording, of a favorite song.<br>So while she lay there sleeping, I read the paper in bed.<br>And in the personals columns, there was this letter I read:<br><br>If you like Pina Coladas, and getting caught in the rain.<br>If you\'re not into yoga, if you have half-a-brain.<br>If you like making love at midnight, in the dunes of the cape.<br>I\'m the love that you\'ve looked for, write to me, and escape.<br><br>I didn\'t think about my lady, I know that sounds kind of mean.<br>But me and my old lady, had fallen into the same old dull routine.<br>So I wrote to the paper, took out a personal ad.<br>And though I\'m nobody\'s poet, I thought it wasn\'t half-bad.<br><br>Yes, I like Pina Coladas, and getting caught in the rain.<br>I\'m not much into health food, I am into champagne.<br>I\'ve got to meet you by tomorrow noon, and cut through all this red tape.<br>At a bar called O\'Malley\'s, where we\'ll plan our escape.<br><br>So I waited with high hopes, then she walked in the place.<br>I knew her smile in an instant, I knew the curve of her face.<br>It was my own lovely lady, and she said, Oh, it\'s you.<br>And we laughed for a moment, and I said, I never knew..<br><br>That you liked Pina Coladas, and getting caught in the rain.<br>And the feel of the ocean, and the taste of champagne.<br>If you like making love at midnight, in the dunes of the cape.<br>You\'re the lady I\'ve looked for, come with me, and escape.<br><br>If you like Pina Coladas, and getting caught in the rain.<br>If you\'re not into yoga, if you have half-a-brain.<br>If you like making love at midnight, in the dunes of the cape.<br>I\'m the love that you\'ve looked for, come with me, and escape. ', 'Rupert Holmes', 'Rupert Holmes', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (67, 'Get Down Tonight', 'Baby, babe, let\'s get together.<br>Honey, hon, me and you.<br>And do the things, ah, do the things<br>That we like to do.<br>Do a little dance, make a little love,<br>Get down tonight.<br>Get down tonight.<br>Do a little dance, make a little love,<br>Get down tonight.<br>Get down tonight.<br>Baby, babe, I\'ll meet you,<br>Same place, same time.<br>Where we can get together<br>And ease up our mind.<br>Do a little dance, make a little love,<br>Get down tonight.<br>Get down tonight.<br>Do a little dance, make a little love,<br>Get down tonight.<br>Get down tonight.<br><br>Do a little dance, make a little love,<br>Get down tonight.<br>Get down tonight.<br><br>Get down, get down, get down, get down,<br>Get down tonight baby.', 'Richard Finch and Harry Wayne Casey', 'KC & The Sunshine Band', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
