  (69, 'Graceland', 'The Mississippi Delta was shining<br>Like a National guitar<br>I am following the river<br>Down the highway<br>Through the cradle of the civil war<br>I\'m going to Graceland<br>Graceland<br>In Memphis Tennessee<br>I\'m going to Graceland<br>Poorboys and Pilgrims with families<br>And we are going to Graceland<br>My traveling companion is nine years old<br>He is the child of my first marriage<br>But I\'ve reason to believe<br>We both will be received<br>In Graceland<br><br>She comes back to tell me she\'s gone<br>As if I didn\'t know that<br>As if I didn\'t know my own bed<br>As if I\'d never noticed<br>The way she brushed her hair from her forehead<br>And she said losing love<br>Is like a window in your heart<br>Everybody sees you\'re blown apart<br>Everybody sees the wind blow<br><br>I\'m going to Graceland<br>Memphis Tennessee<br>I\'m going to Graceland<br>Poorboys and Pilgrims with families<br>And we are going to Graceland<br><br>And my traveling companions<br>Are ghosts and empty sockets<br>I\'m looking at ghosts and empties<br>But I\'ve reason to believe<br>We all will be received<br>In Graceland<br><br>There is a girl in New York City<br>Who calls herself the human trampoline<br>And sometimes when I\'m falling, flying<br>Or tumbling in turmoil I say<br>Woah, so this is what she means<br>She means we\'re bouncing into Graceland<br>And I see losing love<br>Is like a window in your heart<br>Everybody sees you\'re blown apart<br>Everybody feels the wind blow<br><br>In Graceland, in Graceland<br>I\'m going to Graceland<br>For reasons I cannot explain<br>There\'s some part of me wants to see<br>Graceland<br>And I may be obliged to defend<br>Every love, every ending<br>Or maybe there\'s no obligations now<br>Maybe I\'ve a reason to believe<br>We all will be received<br>In Graceland ', 'Paul Simon', 'Paul Simon', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
