  (73, 'Marijuana In Your Brain', 'Marihuana inna your brain<br>Takes more time to ejaculate<br>Roll up a spliff and drowse away the day<br>With marihuana inna your brain<br><br>I\'m knocking on your door<br>But you can\'t move no more<br>You\'re stoned (so stoned)<br>You old hippie in the final sky<br>Fluffy clouds are passing by<br>So stoned (so stoned)<br>Strange weeds a flutter in your mind<br>Worn out jeans are showing your behind<br>Spake cake with a bit of whipped cream<br>Herbal tea and patchouli<br><br>Marihuana inna your brain.......<br><br>Franky boy lie in the grass with me<br>Moon over Woodstock underneath the tree<br>Just blow (just blow)<br>Shockheaded yogi meditate all day<br>Flowerchild chase the war away<br>Just blow (just blow)<br>Revolution make your mind flow free<br>Peace and freedom and a love community<br>Psychadelic posters on your wall<br>Jimmy, Janice, yes you knew them all<br><br>Marijuana inna your brain........<br><br>One lazy summer at a festival<br>In open air, not in a concerthall<br>No way (no way)<br>A spacy mushroom landed in your mouth<br>You couldn\'t tell the north from the south<br>No way (no way)<br>A Hare Krishna member stole your car<br>Right after you made love under a star<br>A junkie robbed you with a silver spoon<br>The golden sixties was a time of doom<br><br>Marijuana inna your brain....... ', 'Lords of Acid', 'Lords of Acid', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
