  (75, 'I\'m Bad I\'m Nationwide', 'Well I was rollin\' down the road in some cold blue steel,<br>I had a blues man in back, and a beautician at the wheel.<br>We going downtown in the middle of the night<br>We laughing and I\'m jokin\' and we feelin\' alright.<br>Oh I\'m bad, I\'m nationwide.<br>Yes I\'m bad, I\'m nationwide.<br><br>Easin\' down the highway in a new Cadillac,<br>I had a fine fox in front, I had three more in the back.<br>They sportin\' short dresses, wearin\' spike-heel shoes,<br>They smokin\' Lucky Strikes, and wearing nylons too.<br>\'Cause we bad, we nationwide.<br>Yeah we bad, we nationwide.<br><br>Well I was movin\' down the road in my V-8 Ford,<br>I had a shine on my boots, I had my sideburns lowered.<br>With my New York brim and my gold tooth displayed,<br>Nobody give me trouble cause they know I got it made.<br>I\'m bad, I\'m nationwide.<br>Well I\'m bad, bad, bad, bad, bad, I\'m nationwide.', 'ZZ Top', 'ZZ Top', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-18 00:00:00', 386, -1),
