  (82, 'Sloop John B.', 'We come on the sloop john b<br>My grandfather and me<br>Around nassau town we did roam<br>Drinking all night<br>Got into a fight<br>Well I feel so broke up<br>I want to go home<br><br>So hoist up the john bs sail<br>See how the mainsail sets<br>Call for the captain ashore<br>Let me go home, let me go home<br>I wanna go home, yeah yeah<br>Well I feel so broke up<br>I wanna go home<br><br>The first mate he got drunk<br>And broke in the capns trunk<br>The constable had to come and take him away<br>Sheriff john stone<br>Why dont you leave me alone, yeah yeah<br>Well I feel so broke up I wanna go home<br><br>So hoist up the john bs sail<br>See how the mainsail sets<br>Call for the captain ashore<br>Let me go home, let me go home<br>I wanna go home, let me go home<br>Why dont you let me go home<br>(hoist up the john bs sail)<br>Hoist up the john b<br>I feel so broke up I wanna go home<br>Let me go home<br><br>The poor cook he caught the fits<br>And threw away all my grits<br>And then he took and he ate up all of my corn<br>Let me go home<br>Why dont they let me go home<br>This is the worst trip Ive ever been on<br><br>So hoist up the john bs sail<br>See how the mainsail sets<br>Call for the captain ashore<br>Let me go home, let me go home<br>I wanna go home, let me go home<br>Why dont you let me go home', '(Traditional)', 'The Kingston Trio, The Beach Boys', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
