  (84, 'Soprano\'s Theme', 'You woke up this morning. Got yourself a gun.<br>Mama always said you\'d be the Chosen One.<br><br>She said: You\'re one in a million you\'ve got to burn to shine,<br>But you were born under a bad sign, with a blue moon in your eyes.<br><br>You woke up this morning all the love has gone,<br>Your Papa never told you about right and wrong.<br><br>But you\'re looking good, baby, I believe you\'re feeling fine, (shame about it),<br>Born under a bad sign with a blue moon in your eyes.<br><br>You woke up this morning the world turned upside down,<br>Thing\'s ain\'t been the same since the Blues walked into town.<br><br>But you\'re one in a million you\'ve got that shotgun shine.<br>Born under a bad sign, with a blue moon in your eyes.<br><br>When you woke up this morning, when you woke up this morning,<br>When you woke up this morning, you got yourself a gun.', 'Alabama 3', 'Alabama 3', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
