  (87, 'Sweater Song', ' (aka Undone)Im me<br>Me be<br>Goddamn<br>I am<br>I can<br>Sing and<br>Hear me<br>Know me<br>If you want to destroy my sweater<br>Hold this thread as I walk away<br><br>Oh no<br>It go<br>It gone<br>Bye-bye<br>Who i<br>I think<br>I sink<br>And I die<br>(chorus) if you want to destroy my sweater<br>Hold this thread as I walk away<br>Watch me unravel Ill soon be naked<br>Lying on the floor, Ive come undone<br><br>(repeat chorus)<br><br>If you want to destroy my sweater<br>(I dont want to destroy your tank-top)<br>Hold this thread as I walk away<br>(lets be friends and just walk away)<br>Watch me unravel Ill soon be naked<br>(hate you see you lyin there in your superman skivvies)<br>Lying on the floor, Ive come undone<br><br>', 'Rivers Cuomo', 'Weezer', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (88, 'Take Me To The River', 'I dont know why I love her like I do<br>All the changes you put me through<br>Take my money, my cigarettes<br>I havent seen the worst of it yet<br>I wanna know that youll tell me<br>I love to stay<br>Take me to the river, drop me in the water<br>Take me to the river, dip me in the water<br>Washing me down, washing me down<br><br>I dont know why you treat me so bad<br>Think of all the things we could have had<br>Love is an ocean that I cant forget<br>My sweet sixteen I would never regret<br><br>I wanna know that youll tell me<br>I love to stay<br>Take me to the river, drop me in the water<br>Push me in the river, dip me in the water<br>Washing me down, washing me<br><br>Hug me, squeeze me, love me, tease me<br>Till I cant, till I cant, till I cant take no more of it<br>Take me to the water, drop me in the river<br>Push me in the water, drop me in the river<br>Washing me down, washing me down<br><br>I dont know why I love you like I do<br>All the troubles you put me through<br>Sixteen candles there on my wall<br>And here am I the biggest fool of them all<br><br>I wanna know that youll tell me<br>I love to stay<br>Take me to the river and drop me in the water<br>Dip me in the river, drop me in the water<br>Washing me down, washing me down.', 'Al Green', 'Al Green / Talking Heads', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-02-02 00:00:00', 386, -1),
  (89, 'That Was Your Mother', 'A long time ago, yeah<br>Before you was born dude<br>When I was still single<br>And life was great<br>I held this job as a traveling salesman<br>That kept me moving from state to state<br>Well, Im standing on the corner of lafayette<br>State of louisiana<br>Wondering where a city boy could go<br>To get a little conversation<br>Drink a little red wine<br>Catch a little bit of those cajun girls<br>Dancing to zydeco<br><br>Along come a young girl<br>Shes pretty as a prayerbook<br>Sweet as an apple on christmas day<br>I said good gracious can this be my luck<br>If thats my prayerbook<br>Lord let us pray<br><br>Well, Im standing on the corner of lafayette<br>State of louisiana<br>Wondering where a city boy could go<br>To get her in a conversation<br>Drink a little red wine<br>Dance to the music of clifton chenier<br>The king of the bayou<br><br>Well, that was your mother<br>And that was your father<br>Before you was born dude<br>When life was great<br>You are the burden of my generation<br>I sure do love you<br>But lets get that straight<br><br>Well, Im standing on the corner of lafayette<br>Arcoss the street from the public<br>Heading down to the lone star cafe<br>Maybe get a little conversation<br>Drink a little red wine<br>Standing in the shadow of clifton chenier<br>Dancing the night away', 'Paul Simon', 'Paul Simon', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (90, 'The Thrill Is Gone', 'The thrill is gone<br>The thrill is gone away<br>The thrill is gone baby<br>The thrill is gone away<br>You know you done me wrong baby<br>And you\'ll be sorry someday<br><br>The thrill is gone<br>It\'s gone away from me<br>The thrill is gone baby<br>The thrill is gone away from me<br>Although I\'ll still live on<br>But so lonely I\'ll be<br><br>The thrill is gone<br>It\'s gone away for good<br>Oh, the thrill is gone baby<br>Baby its gone away for good<br>Someday I know I\'ll be over it all baby<br>Just like I know a man should<br><br>You know I\'m free, free now baby<br>I\'m free from your spell<br>I\'m free, free now<br>I\'m free from your spell<br>And now that it\'s over<br>All I can do is wish you well', 'Rick Darnell & Roy Hawkins', 'B.B. King', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (91, 'Thriller', 'Its close to midnight and something evils lurking in the dark<br>Under the moonlight you see a sight that almost stops your heart<br>You try to scream but terror takes the sound before you make it<br>You start to freeze as horror looks you right between the eyes,<br>Youre paralyzed<br><br>Cause this is thriller, thriller night<br>And no ones gonna save you from the beast about strike<br>You know its thriller, thriller night<br>Youre fighting for your life inside a killer, thriller tonight<br><br>You hear the door slam and realize theres nowhere left to run<br>You feel the cold hand and wonder if youll ever see the sun<br>You close your eyes and hope that this is just imagination<br>But all the while you hear the creature creepin up behind<br>Youre out of time<br><br>Cause this is thriller, thriller night<br>There aint no second chance against the thing with forty eyes<br>You know its thriller, thriller night<br>Youre fighting for your life inside of killer, thriller tonight<br><br>Night creatures call<br>And the dead start to walk in their masquerade<br>Theres no escapin the jaws of the alien this time<br>(theyre open wide)<br>This is the end of your life<br><br>Theyre out to get you, theres demons closing in on every side<br>They will possess you unless you change the number on your dial<br>Now is the time for you and I to cuddle close together<br>All thru the night Ill save you from the terror on the screen,<br>I\'ll make you see<br><br>That this is thriller, thriller night<br>cause I can thrill you more than any ghost would dare to try<br>Girl, this is thriller, thriller night<br>So let me hold you tight and share a killer, diller, chiller<br>Thriller here tonight<br><br>(rap performed by vincent price)<br>Darkness falls across the land<br>The midnite hour is close at hand<br>Creatures crawl in search of blood<br>To terrorize yawls neighbourhood<br>And whosoever shall be found<br>Without the soul for getting down<br>Must stand and face the hounds of hell<br>And rot inside a corpses shell<br>The foulest stench is in the air<br>The funk of forty thousand years<br>And grizzy ghouls from every tomb<br>Are closing in to seal your doom<br>And though you fight to stay alive<br>Your body starts to shiver<br>For no mere mortal can resist<br>The evil of the thriller', 'Michael Jackson and Rod Temperton', 'Michael Jackson', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (92, 'Tupelo Honey', 'You can take all the tea in china<br>Put it in a big brown bag for me<br>Sail right around the seven oceans<br>Drop it straight into the deep blue sea<br>Shes as sweet as tupelo honey<br>Shes an angel of the first degree<br>Shes as sweet as tupelo honey<br>Just like honey from the bee<br><br>You cant stop us on the road to freedom<br>You cant keep us cause our eyes can see<br>Men with insight, men in granite<br>Knights in armor bent on chivalry<br>Shes as sweet as tupelo honey<br>Shes an angel of the first degree<br>Shes as sweet as tupelo honey<br>Just like honey from the bee<br><br>You cant stop us on the road to freedom<br>You cant stop us cause our eyes can see<br>Men with insight, men in granite<br>Knights in armor intent on chivalry<br>Shes as sweet as tupelo honey<br>Shes an angel of the first degree<br>Shes as sweet as tupelo honey<br>Just like honey from the bee<br><br>You know shes alright<br>You know shes alright with me<br>Shes alright, shes alright (shes an angel)<br><br>You can take all the tea in china<br>Put it in a big brown bag for me<br>Sail it right around the seven oceans<br>Drop it smack dab in the middle of the deep blue sea<br>Because shes as sweet as tupelo honey<br>Shes an angel of the first degree<br>Shes as sweet as tupelo honey<br>Just like honey from the bee<br><br>Shes as sweet as tupelo honey<br>Shes an angel of the first degree<br>Shes as sweet as tupelo honey<br>Just like the honey, baby, from the bee<br>Shes my baby, you know shes alright.....', 'Van Morrison', 'Van Morrison', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (93, 'Turn Back The Hands Of Time', 'Oh darling I\'m so lonely without you<br>Can\'t sleep at night always think about you<br>But if I had the chance to start all over<br>I would be wishing today on a four leaf clover<br>And leaving you with the last thing on my mind<br>If I could turn back the hands of time<br><br>Oh darling I can\'t hold out much longer<br>Oh the pain\'s so deep and the hurt is getting stronger<br>But if I had just one more try<br>I would be yours, yours alone until the day I die<br>and we would have a love so divine<br>If I could turn back the hands of time<br><br>Oh darling please, please let me come back home<br>Your love has been so good to me baby<br>And I just relied without it<br>I can\'t go on and you\'re the other half<br>That makes my life complete<br>If I had one more chance we\'d have a love so sweet', 'Tyrone Davis', 'Tyrone Davis', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (94, 'Unhappy', 'Drowning in the gray cell<br>To dwell in earthly hell<br>A pimp warrior fell<br>One-two! Sir Lucious L Left Foot in the muthafuckin\' booth<br>Lucious! (Lucious!) Sir Lucious Left Foot has just entered<br><br>Might as well have fun `cause your happiness is done when your goose is cooked!<br><br>First rule in this thang, never let `em see you sweat!<br>Never let `em be a threat and your feelings you must protect `em!<br>As well as your rectum! Must keep self out of harm, out of danger\'s way<br>Let strangers play while you graduate and move on!<br>True happiness is not acquired and you won\'t find it for sale<br>Unless you\'re in jail and trying to get a bail bondsman to go on and post that bail, you would be happy as Hell<br>You thought you were happy until that court day came<br>Couldn\'t afford that case, no body to take your place, family Hummers at stake<br>Too late to escape and you\'re on the run<br><br><br>One upon a rhyme, one time when I was a child (Flip that smile upside down now)<br>When I found out that Santa Claus was nothing more than Vanilli<br>It was silly, `cause my mom and pop, they worked for every penny<br>Didn\'t have many, but had enough to get by, enough to get fly<br>Only to start the new year off in debt<br>Now you forget your happiness came and went like mom and dad\'s relationship<br>Take a trip, you bring potato chips, I\'ll bring the hot sauce<br><br><br>1979, Dirty South, Local lounge (Flip that smile upside down now!)<br>I never thought that alcohol could ease the notion of the sadness<br>Now what used to be a happy home done turned into some bad shit!<br>Graphic language, mild violence and the silence of the fams!<br>No members to remember, but I know just who I am<br>I\'ve grown into a man and like my nigga said we executed the game plan<br>`Cause we got that hot sauce!!!<br>', 'Outkast', 'Outkast', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (95, 'When the Levee Breaks', 'If it keeps on rainin, levees goin to break,<br>If it keeps on rainin, levees goin to break,<br>When the levee breaks Ill have no place to stay.<br>Mean old levee taught me to weep and moan,<br>Lord, mean old levee taught me to weep and moan,<br>Got what it takes to make a mountain man leave his home,<br>Oh, well, oh, well, oh, well.<br>Dont it make you feel bad<br>When youre tryin to find your way home,<br>You dont know which way to go?<br>If youre goin down south<br>They go no work to do,<br>If you dont know about chicago.<br>Cryin wont help you, prayin wont do you no good,<br>Now, cryin wont help you, prayin wont do you no good,<br>When the levee breaks, mama, you got to move.<br>All last night sat on the levee and moaned,<br>All last night sat on the levee and moaned,<br>Thinkin bout me baby and my happy home.<br>Going, gon to chicago,<br>Gon to chicago,<br>Sorry but I cant take you.<br>Going down, going down now, going down.', 'Kansas Joe McCoy and Memphis Minnie', 'Kansas Joe McCoy and Memphis Minnie, Led Zeppelin', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (96, 'Whispering Bells', '', 'unknown', '', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-31 00:00:00', 1, 0),
  (97, 'Won\'t Back Down', 'Well I wont back down, no I wont back down<br>You can stand me up at the gates of hell<br>But I wont back down<br><br>Gonna stand my ground, wont be turned around<br>And Ill keep this world from draggin me down<br>Gonna stand my ground and I wont back down<br><br>Hey baby, there aint no easy way out<br>Hey I will stand my ground<br>And I wont back down.<br><br>Well I know whats right, I got just one life<br>In a world that keeps on pushin me around<br>But Ill stand my ground and I wont back down<br><br>Hey baby there aint no easy way out<br>Hey I will stand my ground<br>And I wont back down<br>No, I wont back down', 'Tom Petty', 'Tom Petty', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (98, 'Say It Ain\'t So', 'Oh yeah.<br>All right.<br><br>Somebodys heine is crowding my icebox.<br>Somebodys cold one is giving me chills.<br>Guess Ill just close my eyes.<br><br>Oh yeah.<br>All right.<br>Feels good.<br>Inside.<br><br>Flip on the tele... wrestle with jimmy.<br>Somethin is bubblin behind my butt.<br>The bottle is ready to go.<br><br>Say it aint so a-woah-a-woah.<br>Your drug is a heartbreaker.<br>Say it aint so a-woah-a-woah.<br>My love is a life-taker.<br><br>I cant confront you, I never could do...<br>That which might hurt you.<br>Try and be cool, when I say:<br>This way is-a-waterslide-away-from-you-that-takes-you-futher-everyday!<br>Be cool.<br><br>Say it aint so a-woah-a-woah.<br>Your drug is a heartbreaker.<br>Say it aint so a-woah-a-woah.<br>My love is a life-taker!<br><br>Dear daddy, I write you in spite of fears of silence.<br>You cleaned up, found jesus, things are good also I hear.<br>This bottle of stevens awakens ancient feelings...<br>Like father, step-father...<br>The sone is drowning in the flood! yeah yeah-yeah yeah-yeah!<br><br>Say it aint so a-woah-a-woah.<br>You drug is a heartbreaker.<br>Say it aint so a-woah-a-woah.<br>My love is a life-taker.', 'Rivers Cuomo', 'Weezer', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (99, 'Crapshoot', 'step up to the passline<br>come on and make your bets<br>you think you know so much honey<br>you aint seen nothing yet<br>this mess is yours to lie in<br>now that youve made your bed<br>the way you turn your back on things<br>i wont soon forget<br><br>cause i cant see anymore of me taken part in this sad sad deal<br>as they say what will be will be this time has never felt so real<br><br>step up to the passline<br>come on and make your bets<br>you think you got a lock on so much money<br>you aint won nothing yet<br>this bed shes yours to lie in<br>now that youve made your bets<br>the way you turn your back on things i wont soo forget<br><br>cause i cant see anymore of me taken part in this sad sad deal<br>as they say what will be will be<br>wouldnt you agree this time has never felt so real', 'Perpetual Groove', 'Perpetual Groove', '', '', '', 0, '2007-01-01 00:00:00', '2007-03-04 00:00:00', 1, -1),
  (100, 'The Golden Path', 'As I walked along<br>The supposed golden path<br>I was confronted<br>By a mysterious specter<br>he pointed to the graveyard<br>over on yonder hill<br>I paused in cosmic reflection<br>confused and wondering.<br>Of how I came to die to die... (to fade)<br>Hmmm I was confused<br>For if I was dead<br>how and why did I die?<br>but I composed myself<br>and decided I should face him<br>But I stood paralyzed<br>on the supposed golden path.<br>and I was confronted<br>by a powerful demon force<br>and they said it was the devil<br>and when he spoke his words flowed like glowing lava<br>from the mouth of a volcano<br>and I said help me lord ( to fade)<br>I found myself in some kind of hell<br>but I did not believe in a<br>Heaven and hell world of opposite’s kind of reality<br>and I gained control of myself<br>and I decided to press on<br>and as I walked along the supposed golden path<br>I was trembling with fear all the lions and wizards yet to come.<br>I seen in the distance silver mountains rising high and the clouds<br>and voice from above did whisper some shining answer from the womb.<br>Please forgive me I never meant to hurt you<br>Please forgive me I never meant to hurt you<br>Please forgive me I never meant to hurt you<br>Please forgive me I never meant to hurt you<br>As I walked along<br>Please forgive me I never meant to hurt you<br>As I walked along<br>Please forgive me I never meant to hurt you<br>Please forgive me I never meant to hurt you<br>Please forgive me I never meant to hurt you', 'Chemical Brothers', 'Chemical Brothers featuring The Flaming Lips', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (101, 'Gratitude', 'Good Times Gone But You Missed Them What\'s Gone Wrong In<br>Your System Things They Bounce Just Like A Spaulding What\'d<br>You Think Did You Miss Your Calling It\'s So Free This Kind Of Feeling<br>It\'s Like Life It\'s So Appealing When You\'ve Got So Much To Say<br>It\'s Called Gratitude<br><br><br>Good Times Gone But You Feed It Hate\'s Grown Strong<br>You Feel You Need It Just One Thing Do You Know What You Think<br>That The World Owes You What\'s Gonna Set You Free Look Inside<br>And You\'ll See When You\'ve Got So Much To Say It\'s Called Gratitude', 'Beastie Boys', 'Beastie Boys', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (102, 'Only Always', 'Still I try so hard to find a reason, <br>The reasons that I never seem to find. <br>It started as the changing of each season, <br>Still Im feeling lost and so blind. <br><br>Well I feel that you’ll find it\'s fine if you are leaving <br>Leaving everything you know behind <br>It started as a changing of each season <br>Still I am feeling lost and oh so blind <br><br>I still tried so hard to find a reason <br>The reasons that I never seem to find <br>It started as a changing of each reason <br>Still I am feeling lost and oh so blind <br>I feel that you’ll find it\'s fine if you are leaving <br>Know matter how far you feel out of face <br>The answer to the question will I love you? <br>Quite simply is only always. <br><br>I feel that you’ll find it\'s fine if you are leaving <br>Leaving everything you know behind <br>It started as a changing of each season <br>Still I am feeling lost and oh so blind <br><br>All those saddest things I\'ve seen <br>Don\'t come close to what has been <br>All the great things yet to be <br>Things that keep me in between <br>', 'Perpetual Groove', 'Perpetual Groove', 'Intro:<br><br>E----------------------------6-6----------|----------------------------6-6-5---------------|<br>B----------------------------6-6----------|----------------------------6-6-5---------------|<br>G----------------------------7-7----------|----------------------------7-7-6---------------|<br>D----------------------------8-8----------|----------------------------8-8-7---------------|<br>A----------------------------8-6----------|----------------------------8-6-7---------------|<br>E---4p0-5p0-4p0-5p0-4p0-5p0--6-6----------|---4p0-5p0-4p0-5p0-4p0-5p0--6-6-5---------------|<br>&nbsp;&nbsp; <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;