  (104, 'Hard Time Killing Floor Blues', 'Hard time here and everywhere you go<br>Times is harder than ever been before<br><br>And the people are driftin\' from door to door<br>Can\'t find no heaven, I don\'t care where they go<br><br>Hear me tell you people, just before I go<br>These hard times will kill you just dry long so<br><br>Well, you hear me singin\' my lonesome song<br>These hard times can last us so very long<br><br>If I ever get off this killin\' floor<br>I\'ll never get down this low no more<br>No-no, no-no, I\'ll never get down this low no more<br><br>And you say you had money, you better be sure<br>\'Cause these hard times will drive you from door to door<br><br>Sing this song and I ain\'t gonna sing no more<br>Sing this song and I ain\'t gonna sing no more<br>These hard times will drive you from door to door', 'Skip James', 'Skip James', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
