  (106, 'I Want You Back', 'When I had you to myself<br>I didnt want you around<br>Those pretty faces always made you<br>Stand out in a crowd<br>Then someone picked you from the bunch<br>One glance was all it took<br>Now its much too late for me<br>To take second look<br><br>(chorus)<br>Oh baby give me one more chance<br>To show you that I love you<br>Wont you please send me back in your heart<br><br>Oh darlin I was blind to let you go<br>But now since I see you in his arms<br>I want you back<br>Yes I do now<br>I want you back<br>Oo oo baby<br>Yeah yeah....naw....<br><br>Trying to live without your love<br>Is one long sleepless night<br>Let me show you girl<br>That I know wrong from right<br><br>Every street you walk on<br>I leave tear stains on the ground<br>Following the girl<br>I didnt even want around<br>(chorus)<br><br>Abuh buh buh buh<br>All I want!<br>Abuh buh buh buh<br>All I need!<br>Abuh buh buh buh.....', 'The Corporation™: Berry Gordy, Freddie Perren, Alphonzo Mizell, and Deke Richards', 'Jackson 5', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (107, 'ABC', 'A buh-buh buh buh-buh<br>A buh-buh buh buh-buh<br><br>You went to school to learn, girl<br>Things you never, never knew before...<br><br>Like I before E except after C...<br><br>And why 2 plus 2 makes four<br>Now now now, I\'m gonna teach you...<br>Teach you, teach you<br><br>All about love, dear...<br>All about love<br><br>Sit yourself down, take a seat<br>All you gotta do is reapeat after me.<br><br>ABC<br>Easy as 123<br>Or simple as Do re mi<br>ABC, 123, baby, you and me girl!<br><br>Come on, let me love you just a little bit!<br>Come on, let me love you just a little bit!<br>I\'m a going to teach how to sing it out!<br>Come on, come one, come on<br>Let me show you what it\'s all about!<br><br>Reading, writing and arithmetic<br>Are the branches of the learning tree<br><br>But without the roots of love every day, girl<br><br>Your education ain\'t complete<br>T-T-T-Teacher\'s gonna show you<br><br>Show you, show you<br><br>How to get an A!<br>Nyah nyah nyah nyah nyah nyah!<br><br>Spell me you<br>Add the two!<br>Listen to me baby, that\'s all you gotta do!<br><br><br>Sit down, girl! I think I love you!<br>No! Get up, girl! Show me what you can do!<br><br>Shake it, shake it, baby, come on now!<br>Shake it, shake it, baby, ooo oooh!<br>Shake it shake it, baby, huh!<br>123, baby, oo ooo!<br>ABC, baby, nah nah!<br>Do re mi, baby, huh!<br>That\'s how easy love can be.<br><br>ABC, it\'s easy as 123<br>It\'s like counting up to 3<br>Or simple as Do re mi<br>Sing a simple melody<br>That\'s how easy love can be! ', 'The Corporation™: Berry Gordy, Freddie Perren, Alphonzo Mizell, and Deke Richards', 'Jackson 5', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
