  (110, 'Pepper', 'Marky got with Sharon<br>And Sharon got Cherese<br>She was sharing Sharon\'s outlook<br>On the topic of disease<br>Mikey had a facial scar<br>And Bobby was a racist<br>They were all in love with dyin\'<br>They were doing it in Texas<br>Tommy played piano<br>Like a kid out in the rain<br>Then he lost his leg in Dallas<br>He was dancing with a train<br>They were all in love with dyin\'<br>They were drinking from a fountain<br>That was pouring like an avalanche<br>Coming down the mountain<br><br>I don\'t mind the sun sometimes<br>The images it shows<br>I can taste you on my lips<br>And smell you in my clothes<br>Cinnamon and sugary<br>And softly spoken lies<br>You never know just how you look<br>Through other people\'s eyes<br><br>Some will die in hot pursuit<br>In fiery auto crashes<br>Some will die in hot pursuit<br>While sifting through my ashes<br>Some will fall in love with life<br>And drink it from a fountain<br>That is pouring like an avalanche<br>Coming down the mountain<br><br>I don\'t mind the sun sometimes<br>The images it shows<br>I can taste you on my lips<br>And smell you in my clothes<br>Cinnamon and sugary<br>And softly spoken lies<br>You never know just how you look<br>Through other people\'s eyes<br><br>Another Mikey took a knife<br>While arguing in traffic<br>Flipper died a natural death<br>He caught a nasty virus<br>Then there was the ever-present<br>Football player rapist<br>They were all in love with dyin\'<br>They were doing it in Texas<br>Pauly caught a bullet<br>But it only hit his leg<br>Well it should have been a better shot<br>And got him in the head<br>They were all in love with dyin\'<br>They were drinking from a fountain<br>That was pouring like an avalanche<br>Coming down the mountain<br><br>I don\'t mind the sun sometimes<br>The images it shows<br>I can taste you on my lips<br>And smell you in my clothes<br>Cinnamon and sugary<br>And softly spoken lies<br>You never know just how you look<br>Through other people\'s eye