  (112, 'In the Meantime', 'And in the end we shall achieve in time<br>The thing they call divine<br>And all the stars will shine for me<br>When all is well and well is all for all<br>Forever after<br>Living in the meantime wait and see<br><br>We love the all the all of you<br>Where lands are green and skies are blue<br>When all in all we\'re just like you<br>We love the all of you<br><br>And when I cry for me I cry for you<br>With tears of holy joy<br>For all the days still to come<br>And did I ever say I\'d never play<br>Or fly toward the sun<br>Living in the meantime something\'s gone<br><br>We love the all the all of you<br>Where lands are green and skies are blue<br>When all in all we\'re just like you<br>We love the all of you<br><br>Well that sounds fine so I\'ll see you sometime<br>Give my love to the future of the humankind<br>Okay, okay, it\'s not okay.<br>While it\'s on my mind there\'s a girl that fits the crime<br>For a future love dream that I\'m still to find<br>But in the meantime.<br><br>We love the all the all of you<br>Where lands are green and skies are blue<br>When all in all we\'re just like you<br>We love the all of you<br><br>We love the all the all of you<br>Where lands are green and skies are blue<br>When all in all we\'re just like you<br>We love the all of you<br><br>We love the all the all of you<br>Our lands are green and skies are blue<br><br>Just like you,<br>just like you.<br>just like, just like<br>Just like you,<br>just like you.<br>Just like, just like<br>just like you. ', 'Spacehog', 'Spacehog', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (113, 'Bittersweet Symphony', '\'Cause it\'s a bittersweet symphony, this life<br>Trying to make ends meet<br>You\'re a slave to money then you die<br>I\'ll take you down the only road I\'ve ever been down<br>You know the one that takes you to the places<br>where all the veins meet yeah<br><br>No change, I can\'t change<br>I can\'t change, I can\'t change<br>But I\'m here in my mind<br>I am here in my mind<br>But I\'m a million different people<br>from one day to the next<br>I can\'t change my mind<br>No, no, no, no, no, no, no,no,no,no,no,no(fading away)<br><br>Well I never pray<br>But tonight I\'m on my knees yeah<br>I need to hear some sounds that recognize the pain in me, yeah<br>I let the melody shine, let it cleanse my mind, I feel free now<br>But the airways are clean and there\'s nobody singing to me now<br><br>No change, I can\'t change<br>I can\'t change, I can\'t change<br>But I\'m here in my mind<br>I am here in my mind<br>And I\'m a million different people<br>from one day to the next<br>I can\'t change my mind<br>No, no, no, no, no, no, no<br>I can\'t change<br>I can\'t change it<br><br>\'Cause it\'s a bittersweet symphony, this life<br>Trying to make ends meet<br>Trying to find some money then you die<br>I\'ll take you down the only road I\'ve ever been down<br>You know the one that takes you to the places<br>where all the veins meet yeah<br><br>You know I can\'t change, I can\'t change<br>I can\'t change, I can\'t change<br>But I\'m here in my mind<br>I am here in my mind<br>And I\'m a million different people<br>from one day to the next<br>I can\'t change my mind<br>No, no, no, no, no<br><br>I can\'t change my mind<br>no, no, no, no, no,<br>I can\'t change<br>Can\'t change my body,<br>no, no, no<br><br>I\'ll take you down the only road I\'ve ever been down<br>I\'ll take you down the only road I\'ve ever been down<br>Been down<br>Ever been down<br>Ever been down<br>Ever been down<br>Ever been down<br>That you\'ve ever been down<br>That you\'ve ever