  (114, 'Old Friend', 'And the best I\'d hope to see<br>To be floating in a late night stream<br>no trace of time or feeling bad<br>and when I woke I wasn\'t sad<br><br>Oh it\'s so hard to find<br>thoughts that shake my mind<br>No I can\'t see<br>Things in front of me<br>Don\'t know why it\'s so hard to see<br>Although it\' right in front of me<br><br>No trace of time or feeling bad<br>and when I woke I wasn\'t sad<br>Don\'t know why its so hard to find<br>thought she\'d never leave my mind<br>(we walk through the day) - ?<br>follow through with me<br>(and close your patiently) - ?<br><br>how I miss you friend<br>wondering where you\'ve been<br>and how far you\'ve meant to go<br>fear your falling in<br>all is special then<br>lord i hope that you know<br><br>how i miss you friend<br>wondering where you\'ve been<br>and how far you\'ve meant to go<br>i fear your falling in<br>all is special then<br>lord I hope that you know ', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', 0, '2007-01-01 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (116, '99 Red Balloons', 'You and I in a little toy shop<br>buy a bag of balloons with the money we\'ve got<br>Set them free at the break of dawn<br>\'Til one by one, they were gone<br>Back at base, bugs in the software<br>Flash the message, Something\'s out there<br>Floating in the summer sky<br>99 red balloons go by.<br><br>99 red balloons floating in the summer sky<br>Panic bells, it\'s red alert<br>There\'s something here from somewhere else<br>The war machine springs to life<br>Opens up one eager eye<br>Focusing it on the sky<br>Where 99 red balloons go by.<br><br>99 Decision Street, 99 ministers meet<br>To worry, worry, super-scurry<br>Call the troops out in a hurry<br>This is what we\'ve waited for<br>This is it boys, this is war<br>The president is on the line<br>As 99 red balloons go by.<br><br>99 Knights of the air<br>ride super-high-tech jet fighters<br>Everyone\'s a Superhero<br>Everyone\'s a Captain Kirk<br>With orders to identify<br>To clarify and classify<br>Scramble in the summer sky<br>As 99 red balloons go by.<br><br>99 dreams I have had<br>In every one a red balloon<br>It\'s all over and I\'m standin\' pretty<br>In this dust that was a city<br>If I could find a souvenier<br>Just to prove the world was here...<br>And here is a red balloon<br>I think of you and let it go. ', 'Nena', 'Nena', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (117, '99 Red Balloons', 'You and I in a little toy shop<br>buy a bag of balloons with the money we\'ve got<br>Set them free at the break of dawn<br>\'Til one by one, they were gone<br>Back at base, bugs in the software<br>Flash the message, \'Something\'s out there\'<br>Floating in the summer sky<br>99 red balloons go by.<br><br>99 red balloons floating in the summer sky<br>Panic bells, it\'s red alert<br>There\'s something here from somewhere else<br>The war machine springs to life<br>Opens up one eager eye<br>Focusing it on the sky<br>Where 99 red balloons go by.<br><br>99 Decision Street, 99 ministers meet<br>To worry, worry, super-scurry<br>Call the troops out in a hurry<br>This is what we\'ve waited for<br>This is it boys, this is war<br>The president is on the line<br>As 99 red balloons go by.<br><br>99 Knights of the air<br>ride super-high-tech jet fighters<br>Everyone\'s a Superhero<br>Everyone\'s a Captain Kirk<br>With orders to identify<br>To clarify and classify<br>Scramble in the summer sky<br>As 99 red balloons go by.<br><br>99 dreams I have had<br>In every one a red balloon<br>It\'s all over and I\'m standin\' pretty<br>In this dust that was a city<br>If I could find a souvenier<br>Just to prove the world was here...<br>And here is a red balloon<br>I think of you and let it go. ', 'Nena', 'Nena', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, 0),
  (118, 'Man of Constant Sorrow', 'I am a man of constant sorrow,<br>I\'ve seen trouble all of my days;<br>I\'ll bid farewell to old Kentucky,<br>The place where I was born and raised.<br><br>Oh, six long year [sic] I\'ve been blind, friends.<br>My pleasures here on earth are done,<br>In this world I have to ramble,<br>For I have no parents to help me now.<br><br>So fare you well my own true lover,<br>I fear I never see you again,<br>For I\'m bound to ride the Northern railroad,<br>Perhaps I\'ll die upon the train.<br><br>Oh, you may bury me in some deep valley,<br>For many year [sic] there I may lay.<br>Oh, when you\'re dreaming while you\'re slumbering<br>While I am sleeping in the clay.<br><br>Oh, fare you well to my native country,<br>The place where I have loved so well,<br>For I have all kinds of trouble,<br>In this vain world no tongue can tell.<br><br>Dear friends, although I may be a stranger,<br>My face you may never see no more;<br>But there\'s a promise that is given,<br>Where we can meet on that beautiful shore.', 'Richard Burnett', 'Richard Burnett', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
