  (122, 'Atlantis', 'The continent of Atlantis was an island<br>which lay before the great flood<br><br>in the area we now call the Atlantic Ocean.<br>So great an area of land, that from her western shores<br>those beautiful sailors journeyed<br>to the South and the North Americas with ease,<br>in their ships with painted sails.<br><br>To the East Africa was a neighbour, across a short strait of sea miles.<br>The great Egyptian age is but a remnant of The Atlantian culture.<br>The antediluvian kings colonised the world<br>All the Gods who play in the mythological dramas<br>In all legends from all lands were from fair Atlantis.<br>Knowing her fate, Atlantis sent out ships to all corners of the Earth.<br>On board were the Twelve:<br>The poet, the physician, the farmer, the scientist,<br>The magician and the other so-called Gods of our legends.<br>Though Gods they were -<br>And as the elders of our time choose to remain blind<br>Let us rejoice and let us sing and dance and ring in the new<br>Hail Atlantis!<br>Way down below the ocean where I wanna be she may be,<br>Way down below the ocean where I wanna be she may be,<br>Way down below the ocean where I wanna be she may be.<br>Way down below the ocean where I wanna be she may be,<br>Way down below the ocean where I wanna be she may be.<br>My antediluvian baby, oh yeah yeah, yeah yeah yeah,<br>I wanna see you some day<br>My antediluvian baby, oh yeah yeah, yeah yeah yeah,<br>My antediluvian baby,<br>My antediluvian baby, I love you, girl,<br>Girl, I wanna see you some day.<br>My antediluvian baby, oh yeah<br>I wanna see you some day, oh<br>My antediluvian baby.<br>My antediluvian baby, I wanna see you<br>My antediluvian baby, gotta tell me where she gone<br>I wanna see you some day<br>Wake up, wake up, wake up, wake up, oh yeah<br>Oh glub glub, down down, yeah<br>My antediluvian baby, oh yeah yeah yeah yeah', 'Donovan Leitch', 'Donovan', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (123, 'Because I Got High', 'I was gonna clean my room until I got high<br>I gonna get up and find the broom but then I got high<br>my room is still messed up and I know why<br>- cause I got high [repeat 3X]<br><br>I was gonna go to class before I got high<br>I coulda cheated and I coulda passed but I got high<br>I am taking it next semester and I know why<br>- cause I got high [repeat 3X]<br><br>I was gonna go to work but then I got high<br>I just got a new promotion but I got high<br>now I\'m selling dope and I know why<br>- cause I got high [repeat 3X]<br><br>I was gonna go to court before I got high<br>I was gonna pay my child support but then I got high<br>they took my whole paycheck and I know why<br>- cause I got high [repeat 3X]<br><br>I wasnt gonna run from the cops but I was high<br>I was gonna pull right over and stop but I was high<br>Now I am a paraplegic - because I got high [repeat 3X]<br><br>I was gonna pay my car note until I got high<br>I was gonna gamble on the boat but then I got high<br>now the tow truck is pulling away and I know why<br>- because I got high [repeat 3X]<br><br>I was gonna make love to you but then I got high<br>I was gonna eat yo pussy too but then I got high<br>now I\'m jacking off and I know why<br>- cause I got high [repeat 3X]<br><br>I messed up my entire life because I got high<br>I lost my kids and wife because I got high<br>now I\'m sleeping on the sidewalk and I know why<br>- cause I got high [repeat 3X]<br><br>I\'m gonna stop singing this song because I\'m high<br>I\'m singing this whole thing wrong because I\'m high<br>and if I dont sell one copy I know why<br>- cause I\'m high [repeat 3X]', 'Afroman', 'Afroman', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (124, 'Blow Up The Outside World', 'Nothing seems to kill me no matter how hard I try<br>Nothing is closing my eyes<br>Nothing can beat me down for your pain or delight<br>And nothing seems to break me<br>No matter how hard I fall nothing can break me at all<br>Not one for giving up though not invincible I know<br><br><br>I’ve givin’ everything I need<br>I’d give you everything I own<br>I’d give in if it could at least be ours alone<br>I’ve given everything I could<br>To blow it to hell and gone<br>Burrow down in and<br>Blow up the outside world<br><br><br>Someone tried to tell me something<br>Don’t let the world BRING you down<br>Nothing will do me in before I do myself<br>So save it for your own and the ones you can help<br><br><br>Want to make it understood<br>Wanting though I never would<br>Trying though I know it’s wrong<br>Blowing it to hell and gone<br>Wishing though I never could<br>Blow up the outside world', 'Chris Cornell', 'Soundgarden', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (125, 'Can\'t You Hear Me Knocking', 'Yeah, you got satin shoes<br>Yeah, you got plastic boots<br>Yall got cocaine eyes<br>Yeah, you got speed-freak jive<br><br>Cant you hear me knockin on your window<br>Cant you hear me knockin on your door<br>Cant you hear me knockin down your dirty street, yeah<br><br>Help me baby, aint no stranger<br>Help me baby, aint no stranger<br>Help me baby, aint no stranger<br><br>Cant you hear me knockin, ahh, are you safe asleep?<br>Cant you hear me knockin, yeah, down the gas light street, now<br>Cant you hear me knockin, yeah, throw me down the keys<br>Alright now<br><br>Hear me ringing big bell tolls<br>Hear me singing soft and low<br>Ive been begging on my knees<br>Ive been kickin, help me please<br>Hear me prowlin<br>Im gonna take you down<br>Hear me growlin<br>Yeah, Ive got flatted feet now, now, now, now<br>Hear me howlin<br>And all, all around your street now<br>Hear me knockin<br>And all, all around your town', 'Mick Jagger and Keith Richards', 'Rolling Stones', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (126, 'Come Sail Away', 'Im sailing away, set an open course for the virgin sea<br>Ive got to be free, free to face the life thats ahead of me<br>On board, Im the captain, so climb aboard<br>Well search for tomorrow on every shore<br>And Ill try, oh lord, Ill try to carry on<br><br>I look to the sea, reflections in the waves spark my memory<br>Some happy, some sad<br>I think of childhood friends and the dreams we had<br>We live happily forever, so the story goes<br>But somehow we missed out on that pot of gold<br>But well try best that we can to carry on<br><br>A gathering of angels appeared above my head<br>They sang to me this song of hope, and this is what they said<br>They said come sail away, come sail away<br>Come sail away with me<br>Come sail away, come sail away<br>Come sail away with me<br><br>I thought that they were angels, but to my surprise<br>They climbed aboard their starship and headed for the skies<br>Singing come sail away, come sail away<br>Come sail away with me<br>Come sail away, come sail away<br>Come sail away with me', 'Dennis DeYoung', 'Styx', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (127, 'Dead Flowers', 'Well, when youre sitting there<br>In your silk upholstered chair<br>Talking to some rich folks that you know<br>Well I hope you wont see me<br>In my ragged company<br>You know I could never be alone<br><br>Take me down little susie, take me down<br>I know you think youre the queen of the underground<br>And you can send me dead flowers every morning<br>Send me dead flowers by the mail<br>Send me dead flowers to my wedding<br>And I wont forget to put roses on your grave<br><br>Well, when youre sitting back<br>In your rose pink cadillac<br>Making bets on kentucky derby day<br>Ill be in my basement room<br>With a needle and a spoon<br>And another girl to take my pain away<br><br>Take me down little susie, take me down<br>I know you think youre the queen of the underground<br>And you can send me dead flowers every morning<br>Send me dead flowers by the mail<br>Send me dead flowers to my wedding<br>And I wont forget to put roses on your grave<br><br>Take me down little susie, take me down<br>I know you think youre the queen of the underground<br>And you can send me dead flowers every morning<br>Send me dead flowers by the us mail<br>Say it with dead flowers at my wedding<br>And I wont forget to put roses on your grave<br>No I wont forget to put roses on your grave', 'Mick Jagger and Keith Richards', 'Rolling Stones', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (128, 'Didn’t Leave Nobody But The Baby', 'go to sleep little babe<br>go to sleep little babe<br><br>your momma\'s gone away and your daddy\'s gonna stay<br>didn\'t leave nobody but the baby<br><br>go to sleep little babe<br>go to sleep little babe<br><br>everybody\'s gone in the cotton and the corn<br>didn\'t leave nobody but the baby<br><br>you\'re a sweet little babe<br>you\'re a sweet little babe<br><br>honey in the rock and the sugar don\'t stop<br>gonna bring a bottle to the baby<br><br>don\'t you weep pretty babe<br>don\'t you weep pretty babe<br><br>she\'s long gone with her red shoes on<br>gonna need another loving babe<br><br>go to sleep little babe<br>go to sleep little babe<br><br>you and me and the devil makes three<br>don\'t need no other lovin\' babe<br><br>go to sleep little babe<br>go to sleep little babe<br><br>come lay bones on the alabaster stones<br>and be my everlovin baby', 'Alan Lomax, T-Bone Burnett and Gillian Welch', 'Emmylou Harris, Alison Krauss, and Gillian Welch', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
