  (130, 'Fool in the Rain', 'Well theres a light in your eye that keeps shining<br>Like a star that cant wait for the night<br>I hate to think Ive been blinded baby<br>Why cant I see you tonight?<br><br>And the warmth of your smile starts a-burnin<br>And the thrill of your touch gives me fright<br>And Im shaking so much, really yearning<br>Why dont you show up, make it all right?<br>Yeah, its all right.<br><br>And if you promised youd love so completely<br>And you said you would always be true<br>You swore that you would never leave me, baby:<br>What ever happened to you?<br><br>And you thought it was only in movies<br>As you wish all your dreams would come true<br>It aint the first time believe me, baby<br>Im standin here feeling blue<br>Yeah Im blue<br><br>Now I will stand in the rain on the corner<br>Ill watch the people go shuffling downtown<br>Another ten minutes no longer<br>And then Im turning around<br><br>The clock on the walls moving slower<br>My heart it sinks to the ground<br>And the storm that I thought would blow over<br>Clouds the light of the love that I found<br><br>Now my body is starting to quiver<br>And the palms of my hands getting wet<br>Ive got no reason to doubt you baby,<br>Its all a terrible mess<br><br>Ill run in the rain till Im breathless<br>When Im breathless Ill run till I drop, hey<br>The thoughts of a fools kind of careless<br>Im just a fool waiting on the wrong block, oh yeah<br>Light of the love that I found...', 'Jimmy Page, Robert Plant, and John Paul Jones', 'Led Zeppelin', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
