  (132, 'Garden Grove', 'We took this trip to garden grove<br>It smelled like lou-dog inside the van, oh yeah<br>This aint no funky reggae party, $5 at the door<br>It gets so real sometimes, who wrote my rhyme<br>I got the microwave, got the vcr<br>I got the deuce-deuce in the trunk of my car, oh yeah<br>If you only knew all the love that I found<br>Its hard to keep my soul on the ground<br>Youre a fool, dont fuck around with my dog<br>All that I can see I steal, I fill up my garage<br>Cause in my mind<br>Music from jamaica, all the love that I found<br>Pull over theres a reason why my souls unsound<br>Its you<br>Its that shit stuck under my shoe<br>Its that smell inside the van<br>Its my bed sheet covered with sand<br>Sitting through a shitty band<br>Getting dog shit on my hands<br>Getting hassled by the man<br>Waking up to an alarm<br>Sticking needles in your arm<br>Picking up trash on a freeway<br>Feeling depressed everyday<br>Leaving without making a sound<br>Picking my dog at the pound<br>Living in a tweeker pad<br>Getting yelled at by my dad<br>Saying Im happy when Im not<br>Finding roaches in the pot<br>All these things I do<br>They\'re waiting for you.', 'Bradley Nowell', 'Sublime', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (133, 'Get Ready', 'Some folks say smoking herb is a crime,<br>if they catch you smokin<br>they\'re bound to drop the dime<br>insufferable informa crazy fools<br>wait with their fingers crossed<br>for you to break the rules<br><br>and in the evening when we try to jam<br>we like the music loud<br>in this here van<br>we let the bass line drop as loud as we can stand<br>somebody always gotta turn informer for the man<br><br>I want to know right now<br>is there one of you in the crowd<br>are you gonna call 911<br>and spoil all of my fun<br>you crazy fools<br><br>I\'m in the mood<br>get ready<br>I\'m in the mood<br>come on now yeah<br>load up the bong<br>crank up the song<br>let the informer call 911<br><br>(indisguinishable)<br><br>I\'m in the mood<br>get ready<br>im in the moooood<br>come on now yea<br>im in the mood<br>are you ready?<br>im in the mood<br>come on now yea, come on.<br><br>Load up the bong<br>Crank up the song<br>Let the infomer call 911<br><br><br>and when security police force want to arrive<br>don\'t try to run<br>don\'t try to hide<br>just pull out the .9<br>pop in the clip<br>and let one slip<br>into these crazy fools<br><br>I\'m in the mood<br>get ready<br>im in the moooood<br>come on now yea<br>im in the mood<br>are you ready?<br>im in the mood<br>come on now yea, come on.<br><br>and in the evening when we try to jam<br>we like the music loud<br>in this here van<br>O i wanna know, i wanna know right now<br>are you willing are you willing and able, you crazy fool.<br><br><br>Some folks say that smokin herb is a crime,<br>if they catch you smokin<br>they\'re bound to drop the dime<br>insufferable informer crazy fools<br>wait with their fingers crossed<br>for you to break the rules<br><br><br>I\'m in the mood<br>get ready<br>im in the moooood<br>come on now yea<br>im in the mood<br>are you ready?<br>im in the mood<br>Get ready<br>Im in the mood<br>come on now', 'Bradley Nowell', 'Sublime', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00: