  (134, 'Ghostbusters Theme', 'If there\'s somethin\' strange in your neighborhood<br>Who ya gonna call (ghostbusters)<br>If it\'s somethin\' weird an it won\'t look good<br>Who ya gonna call (ghostbusters)<br><br>I ain\'t afraid a no ghost<br>I ain\'t afraid a no ghost<br>If you\'re seein\' things runnin\' thru your head<br>Who can you call (ghostbusters)<br>An\' invisible man sleepin\' in your bed<br>Oh who ya gonna call (ghostbusters)<br>I ain\'t afraid a no ghost<br>I ain\'t afraid a no ghost<br>Who ya gonna call (ghostbusters)<br>If you\'re all alone pick up the phone<br>An call (ghostbusters)<br><br>I ain\'t afraid a no ghost<br>I hear it likes the girls<br>I ain\'t afraid a no ghost<br>Who you gonna call (ghostbusters)<br>Mm…if you\'ve had a dose<br>Of a freaky ghost baby<br>You better call ghostbusters<br>Bustin\' makes me feel good<br>I ain\'t afraid a no ghosts<br><br>Don\'t get caught alone oh no…ghostbuster<br>When he comes through your door<br>Unless you\'ve just got some more<br>I think you better call ghostbusters<br>Ooh... who you gonna call (ghostbusters)<br>Who you gonna call (ghostbusters)<br>Ah, I think you better call (ghostbusters)<br><br>I can\'t hear you…(ghostbusters)<br>Who you gonna call (ghostbusters)<br>Louder ghostbusters<br>Who you gonna call (ghostbusters)<br>Who you can call ghostbusters…', 'Ray Parker Jr.', 'Ray Parker Jr.', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (135, 'Have a Cigar', 'Come in here, dear boy, have a cigar. youre gonna go far, fly high,<br>Youre never gonna die, youre gonna make it if you try;theyre gonna love you.<br>Well Ive always had a deep respect, and I mean that most sincerely.<br>The band is just fantastic, that is really what I think. oh by the way,<br>Which ones pink?<br>And did we tell you the name of the game, boy, we call it riding the<br>Gravy train.<br><br>Were just knocked out. we heard about the sell out. you gotta get an<br>Album out,<br>You owe it to the people. were so happy we can hardly count.<br>Everybody else is just green, have you seen the chart?<br>Its a helluva start, it could be made into a monster if we all pull together<br>As a team.<br>And did we tell you the name of the game, boy, we call it riding the<br>Gravy train.', 'Roger Waters', 'Pink Floyd', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (136, 'Have a Cigar', 'Come in here, dear boy, have a cigar. youre gonna go far, fly high,<br>Youre never gonna die, youre gonna make it if you try;theyre gonna love you.<br>Well Ive always had a deep respect, and I mean that most sincerely.<br>The band is just fantastic, that is really what I think. oh by the way,<br>Which ones pink?<br>And did we tell you the name of the game, boy, we call it riding the<br>Gravy train.<br><br>Were just knocked out. we heard about the sell out. you gotta get an<br>Album out,<br>You owe it to the people. were so happy we can hardly count.<br>Everybody else is just green, have you seen the chart?<br>Its a helluva start, it could be made into a monster if we all pull together<br>As a team.<br>And did we tell you the name of the game, boy, we call it riding the<br>Gravy train.', 'Roger Waters', 'Pink Floyd', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-02-03 00:00:00', 1, 0),
  (137, 'Helter Skelter', 'When I get to the bottom<br>I go back to the top of the slide<br>Where I stop and turn<br>and I go for a ride<br>Till I get to the bottom and I see you again<br>Yeah, yeah, yeah<br>Do you don\'t you want me to love you<br>I\'m coming down fast but I\'m miles above you<br>Tell me tell me come on tell me the answer<br>and you may be a lover but you ain\'t no dancer<br><br>Go helter skelter<br>helter skelter<br>helter skelter<br>Yeah, hu, hu<br>I will you won\'t you want me to make you<br>I\'m coming down fast but don\'t let me break you<br>Tell me tell me tell me the answer<br>You may be a lover but you ain\'t no dancer<br><br>Look out<br>Helter skelter<br>helter skelter<br>helter skelter<br>Yeah, hu, hu<br>Look out cause here she comes<br><br>When I get to the bottom<br>I go back to the top of the slide<br>Where I stop and turn<br>and I go for a ride<br>Till I get to the bottom and I see you again<br>Yeah, yeah, yeah<br><br>Well will you won\'t you want me to make you<br>I\'m coming down fast but don\'t let me break you<br>Tell me tell me tell me the answer<br>You may be a lover but you ain\'t no dancer<br><br>Look out<br>Helter skelter<br>helter skelter<br>helter skelter<br>Yeah, hu,<br><br>Helter Skelter<br>She\'s coming down fast<br>Yes she is<br>Yes she is<br>coming down fast ', 'Lennon/McCartney', 'The Beatles', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (138, 'In The Jailhouse Now', 'I had a friend named Ramblin\' Bob<br>Who used to steal gamble and rob<br>He thought he was the smartest guy in town<br>But I found out last Monday<br>That Bob got locked up Sunday<br>They\'ve got him in the jailhouse way down town<br>He\'s in the jailhouse now he\'s in the jailhouse now<br>I told him once or twice quit playin\' cards and shootin\' dice<br>He\'s in the jailhouse now<br><br>Yodel...<br><br>He played a game called poker pinoccle with Dan Yoker<br>But shooting dice was his greatest game<br>Now he\'s downtown in jail nobody to go his bail<br>The judge done said that he refused a fine<br>He\'s in the jailhouse now he\'s in the jailhouse now<br>I told him once or twice quit playin\' cards and shootin\' dice<br>He\'s in the jailhouse now<br><br>I went out last Tuesday met a gal named Susie<br>Told her I was the swellest guy around<br>We started to spend my money<br>Then she started to call me honey<br>We took in every cabaret in town<br>We\'re in the jailhouse now<br>We\'re in the jailhouse now<br>I told the judge right to his face<br>We didn\'t like to see this place<br>We\'re in the jailhouse now<br><br>Yodel...', 'Jimmie Rodgers', 'Jimmie Rodgers', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
