  (140, 'Just Dropped In (To See What Condition My Condition Was In)', '(Yeah, yeah, oh-yeah, what condition my condition was in)<br><br>I woke up this mornin\' with the sundown shinin\' in<br>I found my mind in a brown paper bag within<br>I tripped on a cloud and fell-a eight miles high<br>I tore my mind on a jagged sky<br>I just dropped in to see what condition my condition was in<br><br>(Yeah, yeah, oh-yeah, what condition my condition was in)<br><br>I pushed my soul in a deep dark hole and then I followed it in<br>I watched myself crawlin\' out as I was a-crawlin\' in<br>I got up so tight I couldn\'t unwind<br>I saw so much I broke my mind<br>I just dropped in to see what condition my condition was in<br><br><br>(Yeah, yeah, oh-yeah, what condition my condition was in)<br><br>Someone painted April Fool in big black letters on a Dead End sign<br>I had my foot on the gas as I left the road and blew out my mind<br>Eight miles outta Memphis and I got no spare<br>Eight miles straight up downtown somewhere<br>I just dropped in to see what condition my condition was in<br><br>I said I just dropped in to see what condition my condition was in<br>Yeah     yeah       oh-yeah<br>', 'Mickey Newbury', 'The First Edition', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
