  (142, 'Kiss', 'U don’t have 2 be beautiful<br>2 turn me on<br>I just need your body baby<br>From dusk till dawn<br>U don’t need experience<br>2 turn me out<br>U just leave it all up 2 me<br>I’m gonna show u what it’s all about<br><br>U don’t have 2 be rich<br>2 be my girl<br>U don’t have 2 be cool<br>2 rule my world<br>Ain’t no particular sign I’m more compatible with<br>I just want your extra time and your<br><br>Kiss<br><br>U got to not talk dirty, baby<br>If u wanna impress me<br>U can’t be 2 flirty, mama<br>I know how 2 undress me (yeah)<br>I want 2 be your fantasy<br>Maybe u could be mine<br>U just leave it all up to me<br>We could have a good time<br><br>U don’t have 2 be rich<br>2 be my girl<br>U don’t have 2 be cool<br>2 rule my world<br>Ain’t no particular sign I’m more compatible with<br>I just want your extra time and your<br><br>Kiss<br><br>Yes<br>I think I wanna dance<br>Gotta, gotta<br>Little girl wendy’s parade<br>Gotta, gotta, gotta<br><br>Women not girls rule my world<br>I said they rule my world<br>Act your age, mama (not your shoe size)<br>Not your shoe size<br>Maybe we could do the twirl<br>U don’t have 2 watch dynasty<br>2 have an attitude<br>U just leave it all up 2 me<br>My love will be your food<br>Yeah<br><br>U don’t have 2 be rich<br>2 be my girl<br>U don’t have 2 be cool<br>2 rule my world<br>Ain’t no particular sign I’m more compatible with<br>I just want your extra time and your', 'Prince', 'Prince and the Revolution', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (143, 'Kitchen of Funk', '', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (144, 'Knight Rider Theme', 'Knight Rider - A shadowy flight into the dangerous world of a man who does not exist.<br><br>Michael Knight, A young loner on a crusade to champion the cause of the innocent,<br>the helpless, the powerless, in a world of criminals who operate above the law.', 'Glen A. Larson and Stu Phillips', NULL, NULL, NULL, NULL, 0, '2007-01-05 00:00:00', '2007-01-05 00:00:00', NULL, -1),
  (145, 'Late in the Evening', 'The first thing I remember, I was lying in my bed<br>I couldn\'t\'ve been no more than one or two<br>And I remember there\'s a radio, coming from the room next door<br>My mother laughed the way some ladies\' do<br><br>Well it\'s late in the evening, and the music\'s seeping through<br><br>The next thing I remember, I am walking down a street<br>I\'m feeling alright I\'m with my boys and with my troops, yeah<br>Down along the avenue some guys were shootin\' pool<br>And I heard the sound of acapella groups, yeah<br><br>Singin\' late in the evening, and all the girls out on the stoops, yeah<br><br>Then I learned to play some lead guitar, I was underage in this funky bar<br>And I stepped outside to smoke myself a J<br>When I come back to the room, everybody just seemed to move<br>And I turned my amp up loud and I began to play<br><br>It was late in the evening, and I blew that room away<br><br>First thing I remember when you came into my life<br>I said I wanna get that girl, no matter what I do<br>Well I guess I\'ve been in love before and once or twice have been on the floor<br>But I\'ve never loved no-one the way that I love you<br><br>..and I love you<br><br>And it was late in the evening, and all the music\'s seeping through', 'Paul Simon', 'Paul Simon', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (146, 'Legalize It', 'Legalize it - don\'t criticize it<br>Legalize it and i will advertise it<br><br>Some call it tampee<br>Some call it the weed<br>Some call it Marijuana<br>Some of them call it Ganja<br><br>Legalize it - don\'t criticize it<br>Legalize it and i will advertise it<br><br>Singer smoke it<br>And players of instruments too<br>Legalize it, yeah, yeah<br>That\'s the best thing you can do<br>Doctors smoke it<br>Nurses smoke it<br>Judges smoke it<br>Even the lawyers too<br><br>Legalize it - don\'t criticize it<br>Legalize it and i will advertise it<br><br>It\'s good for the flu<br>It\'s good for asthma<br>Good for tuberculosis<br>Even umara composis<br><br>Legalize it - don\'t criticize it<br>Legalize it and i will advertise it<br><br>Bird eat it<br>And they leave it<br>Fowls eat it<br>Goats love to play with it ', 'Peter Tosh', 'Peter Tosh', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (147, 'Let Me Do It To You', 'Mmmmmm... Let me do it to you<br>Mmmmmm... Let me do it to you<br>Mmmmmm... Let me do it to you<br>Mmmmmm... Let me do it to you', 'J.J. Cale', 'J.J. Cale', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (148, 'Looking Out My Back Door', 'Just got home from Illinois, lock the front door, oh boy!<br><br>Got to sit down, take a rest on the porch.<br>Imagination sets in, pretty soon I\'m singin\',<br>Dude, dude, dude, Lookin\' out my back door.<br><br>There\'s a giant doing cartwheels, a statue wearin\' high heels.<br>Look at all the happy creatures dancing on the lawn.<br>A dinosaur Victrola list\'ning to Buck Owens.<br>Dude, dude, dude, Lookin\' out my back door.<br><br>CHORUS<br><br>Tambourines and elephants are playing in the band.<br>Won\'t you take a ride on the flyin\' spoon?<br>Doo, doo doo.<br>Wond\'rous apparition provided by magician.<br>Doo, doo, doo, Lookin\' out my back door.<br><br>CHORUS<br><br>Tambourines and elephants are playing in the band.<br>Won\'t you take a ride on the flyin\' spoon?<br>Doot, doot doo.<br>Bother me tomorrow, today, I\'ll have no sorrows.<br>Doot, doot, doo, Lookin\' out my back door.<br><br>CHORUS<br><br>Forward troubles Illinois, lock the front door, oh boy!<br>Look at all the happy creatures dancing on the lawn.<br>bother me tomorrow, today, I\'ll have no sorrows.<br>Doo, doo, doo, Lookin\' out my back door.', 'John Fogerty', 'Creedence Clearwater Revival', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (149, 'Mr. Brownstone', 'I get up around seven<br>Get outta bed around nine<br>And I don\'t worry about nothin\' no<br>\'Cause worrin\'s a waste of my... time<br><br>The show usually starts around seven<br>We go on stage around nine<br>Get on the bus about eleven<br>Sippin\' a drink and feelin\' fine<br><br>Chorus:<br>We been dancin\' with Mr. Brownstone<br>He\'s been knockin\'<br>He won\'t leave me alone<br>No, no ,no, he won\'t leave me alone<br>I used ta do a little but a little wouldn\'t do<br>So the little got more and more<br>I just keep tryin\' ta get a little better<br>Said the little better than before<br>I used ta do a little but a little wouldn\'t do<br>So the little got more and more<br>I just keep tryin\' ta get a little better<br>Said the little better than before<br><br>Chorus<br><br>Now I get up around whenever<br>I used ta get up on time<br>But that old man he\'s a real muthafucker<br>Gonna kick him on down the line<br><br>I used ta do a little but a little wouldn\'t do<br>So the little got more and more<br>I just keep tryin\' ta get a little better<br>Said the little better than before<br>I used ta do a little but a little wouldn\'t do<br>So the little got more and more<br>I just keep tryin\' ta get a little better<br>Said the little better than before<br><br>Chorus<br>Shoved it in the bindle and I shot it in the middle<br>And it, it drove outta my mind<br>I should\'ve known better, said I wish I never met her Said I,<br>I leave it all behind Yowsa! ', 'Izzy Stradlin and Slash', 'Guns N\' Roses', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (150, 'The Man In Me', 'The man in me will do nearly any task,<br>And as for compensation, there\'s little he would ask.<br>Take a woman like you<br>To get through to the man in me.<br><br>Storm clouds are raging all around my door,<br>I think to myself I might not take it any more.<br>Take a woman like your kind<br>To find the man in me.<br><br>But, oh, what a wonderful feeling<br>Just to know that you are near,<br>Sets my a heart a-reeling<br>From my toes up to my ears.<br><br>The man in me will hide sometimes to keep from bein\' seen,<br>But that\'s just because he doesn\'t want to turn into some machine.<br>Took a woman like you<br>To get through to the man in me.', 'Bob Dylan', 'Bob Dylan', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (151, 'Moving In Stereo', 'Lifes the same Im moving in stereo<br>Lifes the same except for my shoes<br>Lifes the same youre shakin like tremolo<br>Lifes the same its all inside you<br><br>Its so easy to blow up your problems<br>Its so easy to play up your breakdown<br>Its so easy to fly through a window<br>Its so easy to fool with the sound<br><br>Its so tough to get up<br>Its so tough<br>Its so tough to live up<br>Its so tough on you<br><br>Lifes the same Im moving in stereo<br>Lifes the same except for my shoes<br>Lifes the same youre shakin like tremolo<br>Lifes the same its all inside you<br><br>Lifes the same Im moving in stereo<br>Lifes the same except for my shoes<br>Lifes the same youre shakin like tremolo<br>Lifes the same its all inside you', 'Greg Hawkes and Ric Ocasek', 'The Cars', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
