  (154, 'Peaches', 'Movin to the country gonna eat a lot of peaches<br>Im movin to the country Im gonna eat me a lot of peaches<br>Im movin to the country Im gonna eat a lot of peaches<br>Movin to the country Im gonna eat a lot of peaches<br>Peaches come from a can they were put there by a man<br>In a factory downtown<br>If I had my little way Id eat peaches everyday<br>Sun soakin bulges in the shade<br><br>Movin to the country Im gonna eat a lot of peaches<br>Movin to the country Im gonna eat a lot of peaches<br>Im movin to the country gonna eat a lot of peaches<br>Movin to the country gonna eat a lot of peaches<br><br>I took a little nap where the roots all twist<br>Squished a rotten peach in my fist<br>And dreamed about you woman<br>I poked my finger down inside makin a little room for a ant to hide<br>Natures candy in my hand or can or a pie<br><br>Millions of peaches peaches for me<br>Millions of peaches peaches for free<br>Millions of peaches peaches for me<br>Millions of peaches peaches for free<br><br>Look out<br><br>Millions of peaches peaches for me<br>Millions of peaches peaches for free<br>Millions of peaches peaches for me<br>Millions of peaches peaches for free<br><br>Look out<br><br>', 'Chris Ballew and The Presidents of the United States of America', 'The Presidents of the United States of America', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
