  (156, 'Po\' Lazarus', 'Well, the high sheriff<br>He told his deputy<br>Want you go out and bring me Lazarus<br>Well, the high sheriff<br>Told his deputy<br>I want you go out and bring me Lazarus<br>Bring him dead or alive,<br>Lawd, Lawd<br>Bring him dead or alive<br>Well the deputy he told the high sheriff<br>I ain\'t gonna mess with Lazarus<br>Well the deputy he told the high sheriff<br>Says I ain\'t gonna mess with Lazarus<br>Well he\'s a dangerous man<br>Lawd, Lawd<br>He\'s a dangerous man<br>Well then the high sheriff, he found Lazarus<br>He was hidin\' in the chill of a mountain<br>Well the high sheriff, found Lazarus<br>He was hidin\' in the chill of the mountain<br>With his head hung down<br>Lawd, Lawd<br>With his head hung down<br>Well then the high sheriff, he told Lazarus<br>He says Lazarus I come to arrest you<br>Well the high sheriff, told Lazarus<br>Says Lazarus I come to arrest you<br>And bring ya dead or alive<br>Lawd, Lawd<br>Bring you dead or alive<br>Well then Lazarus, he told the high sheriff<br>Says I never been arrested<br>Well Lazarus, told the high sheriff<br>Says I never been arrested<br>By no one man<br>Lawd, Lawd<br>By no one man<br>And then the high sheriff, he shot Lazarus<br>Well, he shot him mighty big number<br>Well the high sheriff, shot Lazarus<br>Well he shot him with a mighty big number<br>With a forty five<br>Lawd, Lawd<br>With a forty five<br>Well then they take old Lazarus<br>Yes they laid him on the commissary gallery<br>Well they taken poor Lazarus<br>And the laid him on the commissary gallery<br>He said my wounded side<br>Lawd, Lawd<br>My wounded side', 'Alan Lomax', 'James Carter and The Prisoners', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (157, 'Proud Mary', 'Left a good job in the city,<br>Workin for the man evry night and day,<br>And I never lost one minute of sleepin,<br>Worryin bout the way things might have been.<br><br>Chorus:<br>Big wheel keep on turnin,<br>Proud mary keep on burnin,<br>Rollin, rollin, rollin on the river.<br><br>Cleaned a lot of plates in memphis,<br>Pumped a lot of pain down in new orleans,<br>But I never saw the good side of the city,<br>til I hitched a ride on a river boat queen.<br><br>Chorus<br><br>Rollin, rollin, rollin on the river.<br><br>If you come down to the river,<br>Bet you gonna find some people who live.<br>You dont have to worry cause you have no money,<br>People on the river are happy to give.<br><br>Chorus<br><br>Rollin, rollin, rollin on the river.<br>Rollin, rollin, rollin on the river.<br>Rollin, rollin, rollin on the river.', 'John Fogerty', 'Creedence Clearwater Revival', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (158, 'Pusherman', 'i\'m your mamma, i\'m your daddy<br>i\'m that nigga in the alley<br>i\'m your doctor, when in need<br>want some coke, have some weed<br>you know me, i\'m your friend<br>your main boy, thick and thin<br>i\'m your pusherman<br>i\'m your pusherman<br><br>haha<br><br>ain\'t i clean, bad machine<br>super cool, super mean<br>feelin\' good, for the man<br>Superfly, here i stand<br>secret stash, heavy bread<br>baddest bitches, in the bed<br><br>i\'m your pusherman<br>i\'m your pusherman<br>i\'m your pusherman<br><br>solid life, of crime<br>a man of odd circumstance<br>a victim of ghetto demands<br>feed me money for [style]<br>and i\'ll let you trip for a while<br>insecure from the past<br>how long can a good thing last?<br>woo-hoo, no<br>got to be mellow, y\'all<br>gotta get mellow now<br>pusherman gettin\' mellow y\'all<br><br>heavy mind, have you signed?<br>makin\' money all the time<br>my [LD] entrusts me<br>for all junkies to see<br>ghetto prince is my thing<br>makin\' love\'s how i swing<br>i\'m your pusherman<br>i\'m your pusherman<br>huh<br><br>too bad, [Splee]<br>for a generous fee<br>make your world what you want it to be<br>got a woman i love desperately<br>wanna give her something better than me<br>been told i can\'t be nothin\' else<br>just a hustler in spite of myself<br>i know i can rake it<br>this life just don\'t make it<br>lord, lord<br>got to get mellow now<br>gotta be mellow, y\'all<br>got to get mellow now<br><br>i\'m your mamma, i\'m your daddy<br>i\'m that nigga in the alley<br>i\'m your doctor, when in need<br>want some coke, have some weed<br>you know me, i\'m your friend<br>your man boy, thick and thin<br>i\'m your pusherman<br>i\'m your pusherman', 'Curtis Mayfield', 'Curtis Mayfield', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (159, 'Pusherman', 'I\'m your mama, I\'m your daddy,<br>I\'m that nigga in the alley.<br>I\'m your doctor when in need.<br>Want some coke? Have some weed.<br>You know me, I\'m your friend,<br>Your main boy, thick and thin.<br>I\'m your pusherman.<br><br>Ain\'t I clean, bad machine<br>Super cool, super mean<br>Dealin\' good, for The Man.<br>Superfly, here I stand.<br>Secret stash, heavy bread,<br>Baddest bitches in the bed,<br>I\'m your pusherman<br><br>Silent life of crime<br>A man of odd circumstance,<br>A victim of ghetto demands.<br>Feed me money for style<br>And I\'ll let you trip for a while.<br>Insecure from the past,<br>How long can a good thing last?<br>No, no, no<br><br>Got to be mellow, y\'all<br>Got to get mellow, now<br>Pusherman gettin\' mellow, y\'all<br><br>Heavy mind, every sign<br>Makin\' money all the time<br>My LD and just me<br>For all junkies to see<br>Ghetto Prince is my thing<br>Makin\' love\'s how I swing<br>I\'m your pusherman<br><br>Two bags, please<br>For a generous fee<br>Make your world what you want it to be<br>Got a woman I love desperately<br>Wanna give her somethin\' better than me<br>Been told I can\'t be nuthin\' else<br>Just a hustler in spite of myself<br>I know I can break it<br>This life just don\'t make it<br>Lord, Lord, yeah<br><br>Got to get mellow, now<br>Gotta be mellow, y\'all<br>Got to get mellow, now<br><br>I\'m your mama, I\'m your daddy,<br>I\'m that nigga in the alley.<br>I\'m your doctor when in need.<br>Want some coke? Have some weed.<br>You know me, I\'m your friend,<br>Your main boy, thick and thin.<br>I\'m your pusherman.<br>I\'m your pusherman.<br>I\'m your pusherman.<br>I\'m your pusherman.<br>Lord, Lord', 'Curtis Mayfield', 'Curtis Mayfield', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, 0),
  (160, 'Ring of Fire', 'Love Is A Burning Thing<br>And It Makes A Fiery Ring<br>Bound By Wild Desire<br>I Fell Into A Ring Of Fire<br><br>CHORUS:<br>I Fell Into A Burning Ring Of Fire<br>I Went Down, Down, Down<br>And The Flames Went Higher<br><br>And It Burns, Burns, Burns<br>The Ring Of Fire<br>The Ring Of Fire<br><br>I Fell Into A Burning Ring Of Fire<br>I Went Down, Down, Down<br>And The Flames Went Higher<br><br>And It Burns, Burns, Burns<br>The Ring Of Fire<br>The Ring Of Fire<br><br>The Taste Of Love Is Sweet<br>When Hearts Like Ours Meet<br>I Fell For You Like A Child<br>Oh, But The Fire Went Wild<br><br>CHORUS<br>I Fell Into A Burning Ring Of Fire<br>I Went Down, Down, Down<br>And The Flames Went Higher<br><br>And It Burns, Burns, Burns<br>The Ring Of Fire<br>The Ring Of Fire<br><br>I Fell Into A Burning Ring Of Fire<br>I Went Down, Down, Down<br>And The Flames Went Higher<br><br>And It Burns, Burns, Burns<br>The Ring Of Fire<br>The Ring Of Fire<br><br>And It Burns, Burns, Burns<br><br>The Ring Of Fire<br><br>The Ring Of Fire', 'June Carter and Merle Kilgore', 'Johnny Cash', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (161, 'Roadhouse Blues', 'Keep your eyes on the road,<br>Your hands upon the wheel.<br>Keep your eyes on the road<br>Your hands upon the wheel.<br>Yeah, we\'re going to the roadhouse,<br>Gonna have a real good-time.<br><br>Yeah, the back of the roadhouse,<br>They\'ve got some bungalows.<br>Yeah, the back of the roadhouse,<br>They\'ve got some bungalows.<br><br>They dance for the people<br>Who like to go down slow.<br><br>Let it roll, baby, roll.<br>Let it roll, baby, roll.<br>Let it roll, baby, roll.<br>Let it roll, all night long.<br><br>Do it, Robby, Do it!<br><br>You gotta roll, roll, roll,<br>You gotta thrill my soul, alright.<br>Roll, roll, roll, roll-a<br>Thrill my soul.<br><br>*improv*<br><br>Ashen-Lady.<br>Ashen-Lady.<br>Give up your vows.<br>Give up your vows.<br>Save our city.<br>Save our city.<br>Ah, right now.<br><br>Well, I woke up this morning<br>And I got myself a beer.<br>Well, I woke up this morning<br>And I got myself a beer.<br><br>The future\'s uncertain<br>And the end is always near.<br><br>Let it roll, baby, roll.<br>Let it roll, baby, roll.<br>Let it roll, baby, roll.<br>Let it roll, all night long.<br><br><br>', 'The Doors', 'The Doors', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (162, 'Rock You Like A Hurricane', 'It\'s early morning<br>The sun comes out<br>Last night was shaking<br>And pretty loud<br>My cat is purring<br>And scratches my skin<br>So what is wrong<br>With another sin<br>The bitch is hungry<br>She needs to tell<br>So give her inches<br>And feed her well<br>More days to come<br>New places to go<br>I\'ve got to leave<br>It\'s time for a show<br><br>Here I am, rock you like a hurricane<br>Here I am, rock you like a hurricane<br><br>My body is burning<br>It starts to shout<br>Desire is coming<br>It breaks out loud<br>Lust is in cages<br>Till storm breaks loose<br>Just have to make it<br>With someone I choose<br>The night is calling<br>I have to go<br>The wolf is hungry<br>He runs to show<br>He\'s licking his lips<br>He\'s ready to win<br>On the hunt tonight<br>For love at first sting<br><br>Here I am, rock you like a hurricane<br>Here I am, rock you like a hurricane<br>Here I am, rock you like a hurricane<br>Here I am, rock you like a hurricane', 'Klaus Meine, Herman Rarebell and Michael Schenker', 'Scorpions', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (163, 'Rollout (My Business)', 'I got my twin glock .40s, cocked back<br>Me and my homies, so drop that<br>We rollin on twenties, with the top back<br>So much money, you can\'t stop that<br>Twin glock .40s, cocked back<br>Me and my homies, so drop that<br>We rollin on twenties, with the top back<br>So much money, you can\'t stop that<br><br>Now where\'d you get that platinum chain with them diamonds in it?<br>Where\'d you get that matchin Benz with them windows tinted?<br>Who them girls you be with when you be ridin through?<br>Man I ain\'t got nothin to prove, I paid my dues<br>Breakin the rules, I shake fools while I\'m takin a cruise.<br>Tell me who\'s your weed man, how do you smoke so good?<br>You\'s a superstar boy, why you still up in the hood?<br>What in the world is in that BAG, what you got in that BAG?<br>A couple a cans a whoop ass, you did a good ass job of just eyein me, spyin me<br><br>[Chorus]<br><br>Man, that car don\'t come out until next year, where in the fuck did you get it?<br>That\'s eighty-thousand bucks GONE, where in the fuck did you spend it?<br>You must have eyes on your back, \'cause you got money to the ceiling<br>And the bigger the cap, the bigger the peelin<br>The better I\'m feelin, the more that I\'m chillin<br>Winnin, drillin and killin the feelin<br>Now who\'s that bucked-naked cook fixin three-course meals?<br>Gettin goosebumps when her body tap the six inch heels<br>What in the world is in that ROOM, what you got in that ROOM?<br>A couple a gats, a couple a knives, a couple of rats, a couple of wives<br>Now it\'s time to choose<br><br>[Chorus]<br><br>Are you custom-made, custom-paid, or you just custom-fitted?<br>Playstation 2 up in the ride and is that Lorenzo-kitted?<br>Is that your wife, your girlfriend or just your main bitch?<br>You take a pick, while I\'m rubbin the hips, touchin lips to the top of the dick and then whewwww!<br>Now tell me who\'s your housekeeper and what you keep in your house?<br>What about diamonds and gold, is that what you keep in your mouth?<br>What in the world is in that CASE, what you got in that CASE?<br>Get up out my face, you couldn\'t relate, wait to take place at a similar pace<br>So shake, shake it<br><br>[(Chorus) 1/2x]<br><br>Get out my business, my biznass<br>Stay the fuck up out my biznass, ah<br>\'Cause these niggas all up in my shit and it\'s my business,<br>my biznass<br>Stay the fuck up out my biznass, \'cause it\'s mine, oh mine<br>My business, my biznass<br>Stay the fuck up out my biznass<br>\'Cause these niggas all up in my shit...', 'Ludacris', 'Ludacris', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
