  (171, 'Under African Skies', 'Josephs face was black as night<br>The pale yellow moon shone in his eyes<br>His path was marked<br>By the stars in the southern hemisphere<br>And he walked his days<br>Under african skies<br>This is the story of how we begin to remember<br>This is the powerful pulsing of love in the vein<br>After the dream of falling and calling your name out<br>These are the roots of rhythm<br>And the roots of rhythm remain<br><br>In early memory<br>Mission music<br>Was ringing round my nursery door<br>I said take this child, lord<br>From tucson arizona<br>Give her the wings to fly through harmony<br>And she wont bother you no more<br><br>This is the story of how we begin to remember<br>This is the powerful pulsing of love in the vein<br>After the dream of falling and calling your name out<br>These are the roots of rhythm<br>And the roots of rhythm remain<br><br>Josephs face was black as night<br>And the pale yellow moon shone in his eyes<br>His path was marked<br>By the stars in the southern hemisphere<br>And he walked the length of his days<br>Under african skies', 'Paul Simon', 'Paul Simon', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (172, 'Up In Smoke', 'Up in smoke<br>Thats where my money goes<br>In my lungs<br>and sometimes up my nose<br>When troubled times<br>Begin to bother me<br>I take a toke<br>and all my cares<br>Go up in smoke<br><br>Up in smoke<br>Donde todos es mi rey<br>There are no signs<br>Que dice no fumer<br>So I roll un bomber<br>Y me doy, un buen toke-ay<br>Y despues I choke<br>Y todos mis cares<br>Go up in smoke<br>Come on let\'s go get high<br><br>Up in smoke<br>That\'s where I wanna be<br>\'Cause when I\'m high<br>The world below<br>Don\'t bother me<br>When life begins<br>To be one long<br>and dangerous road<br>I take a toke<br>and all my cares<br>Go up in smoke', 'Cheech Marin and Tommy Chong', 'Cheech Marin and Tommy Chong', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (173, 'Viva Las Vegas', 'Bright light city gonna set my soul<br>Gonna set my soul on fire<br>Got a whole lot of money thats ready to burn,<br>So get those stakes up higher<br>Theres a thousand pretty women waitin out there<br>And theyre all livin devil may care<br>And Im just the devil with love to spare<br>Viva las vegas, viva las vegas<br><br>How I wish that there were more<br>Than the twenty-four hours in the day<br>cause even if there were forty more<br>I wouldnt sleep a minute away<br>Oh, theres black jack and poker and the roulette wheel<br>A fortune won and lost on evry deal<br>All you needs a strong heart and a nerve of steel<br>Viva las vegas, viva las vegas<br><br>Viva las vegas with you neon flashin<br>And your one armbandits crashin<br>All those hopes down the drain<br>Viva las vegas turnin day into nighttime<br>Turnin night into daytime<br>If you see it once<br>Youll never be the same again<br><br>Im gonna keep on the run<br>Im gonna have me some fun<br>If it costs me my very last dime<br>If I wind up broke up well<br>Ill always remember that I had a swingin time<br>Im gonna give it evrything Ive got<br>Lady luck please let the dice stay hot<br>Let me shout a seven with evry shot<br>Viva las vegas, viva las vegas,<br>Viva, viva las vegas', 'Doc Pomus and Mort Shuman', 'Elvis Presley', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
