  (176, 'Word Up', 'Your pretty ladies around the world<br>Got a weird thing to show you<br>So tell all the boys and girls<br>Tell your brother, your sister and your mamma too<br>we\'re about to go down<br>And you know just what to do<br>Wave your hands in the air like you don\'t care<br>Gilde by the people as they start to look and stare<br>Do your dance, do your dance, do your dance quick mamma<br>Come on baby tell me what\'s the word<br><br>Word up everybody says<br>When you hear the call you\'ve got to get it underway<br>Word up it\'s the code word<br>No matter where you say it you know that you\'ll be heard<br><br>Now all you sucker DJ\'s who think you\'re fly<br>There\'s got to be a reason and we know the reason why<br>Why you put on thoso airs and you act real cool<br>Got to realise that you\'re acting like fools<br>If there\'s music we can use it<br>You\'re free to dance<br>We don\'t have the time for psychological romance<br>No romance, no romance, no romance for me mamma<br>[ these lyrics found on http://www.completealbumlyrics.com ]<br><br>Come on baby tell me what\'s the word<br><br>Word up everybody says<br>When you hear the call you\'ve got to get it underway<br><br>Dial L for love, Dial L for love, Dial L for love<br>W.O.R.D. UP, W.O.R.D. UP, W.O.R.D. UP, W.O.R.D. UP<br><br>Yeh you sucker DJ\'s who think you\'re fly<br>There\'s got to be a reason and we know the reason why<br>Why you put on thoso airs and you act real cool<br>Got to realise that you\'re acting like fools<br>No romance, no romance, no romance for me mamma<br>Come on baby tell me what\'s the word<br><br>Word up everybody says<br>When you hear the call you\'ve got to get it underway<br>Word up it\'s the code word<br>No matter where you say it you know that you\'ll be heard<br><br>Word up everybody says<br>When you hear the call you\'ve got to get it underway<br>Word up it\'s the code word<br>No matter where you say it you know that you\'ll be heard', 'Larry Blackmon and Tomi Jenkins', 'C