  (179, 'No Decorations', 'Opened my eyes to look<br>And see all the hardwood floors were bare<br>Things that had such charm<br>Now have no decorations there<br>Far in the distance now<br>is often where I stare<br>One can only hope<br>good for all of us is there<br><br>All this is just meant to say<br>Here you have a friendly ear , if you need one<br>Just a mere lament your way<br>If that which was bright in your life seems to have dimmed some<br><br>Maybe on one fine day<br>If you feel afraid that your fears soon will be gone<br>There\'s not much thats left to say<br>Said it all before , but it always turned out wrong ', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', 0, '2007-01-05 00:00:00', '2007-01-10 00:00:00', 386, -1),
  (180, 'Two Shores', 'So pleased to find things still amaze me<br>they have yet to run out, that\'s for sure<br>every day i find things awaking<br>let\'s me know there\'s more, to this life<br><br>something worth saving<br><br>i feel i\'ve washed so far from the shore<br>and the water\'s still nice<br><br>Used to be that days like these didn\'t phase me<br>now i\'m not so sure that i know, who knows?<br>wish i could look on things with a simple beauty<br>like the freshness of new fallen snow<br><br>who knows?<br>maybe i\'m going half crazy<br>when it\'s time to go, it\'s time to go<br><br>but the water\'s so nice<br>', 'Perpetual Groove', 'Perpetual Groove', '', '', '', 0, '2007-01-05 00:00:00', '2007-03-04 00:00:00', 1, -1),
