  (183, 'Save For One', 'Well I gave, my best guess<br>left me more, than a little less<br>of things I need, yet can\'t find<br>things that ease.... my mind<br><br>oh, oh oh oh oh ohhhh<br><br>Well my friends, I hope we<br>cannnnn say, before we go,<br>that we strolled, head held high<br>and we gave, one helluva show<br><br>oh, oh oh ohh, ohh<br><br>well there\'s few, things as nice<br>as an early morning drive<br>there\'s no construction and no lights<br>Save For One<br>the natural light of day<br><br>Save For One<br>Save For One<br>Save For One<br>Save For One', 'Perpetual Groove', 'Perpetual Groove', '', NULL, '', 0, '2007-01-06 00:00:00', '2007-01-10 00:00:00', 386, -1),
