  (186, 'Space Oddity', 'Ground Control to Major Tom<br>Ground Control to Major Tom<br>Take your protein pills<br>and put your helmet on<br><br>Ground Control to Major Tom<br>Commencing countdown,<br>engines on<br>Check ignition<br>and may God\'s love be with you<br><br>[spoken]<br>Ten, Nine, Eight, Seven, Six, Five, Four, Three, Two, One, Liftoff<br><br>This is Ground Control<br>to Major Tom<br>You\'ve really made the grade<br>And the papers want to know whose shirts you wear<br>Now it\'s time to leave the capsule<br>if you dare<br><br>This is Major Tom to Ground Control<br>I\'m stepping through the door<br>And I\'m floating<br>in a most peculiar way<br>And the stars look very different today<br><br>For here<br>Am I sitting in a tin can<br>Far above the world<br>Planet Earth is blue<br>And there\'s nothing I can do<br><br>Though I\'m past<br>one hundred thousand miles<br>I\'m feeling very still<br>And I think my spaceship knows which way to go<br>Tell my wife I love her very much<br>she knows<br><br>Ground Control to Major Tom<br>Your circuit\'s dead,<br>there\'s something wrong<br>Can you hear me, Major Tom?<br>Can you hear me, Major Tom?<br>Can you hear me, Major Tom?<br>Can you....<br><br>Here am I floating<br>round my tin can<br>Far above the Moon<br>Planet Earth is blue<br>And there\'s nothing I can do.', 'David Bowie', 'David Bowie', NULL, NULL, NULL, 0, '2007-01-15 00:00:00', '2007-01-15 00:00:00', 0, -1),
